    "Knee_Push_ups": "Kneel on the floor.Extend arms and put hands shoulder-width apart on the floor in front of you.Tighten abs while you bend arms, lowering your torso until chest grazes the floor.Push torso back up by straightening arms. Slow and steady, baby.Rinse and repeat.",
    "E_Triceps_Dips": "Sit on the edge of a stable chair, weight bench, or step and grip the edge next to your hips. Your fingers should be pointed at your feet, your legs extended, and your feet about hip-width apart, with the heels touching the ground. Look straight ahead with your chin up.Press into your palms to lift your body and slide forward just far enough that your behind clears the edge of the chair.Lower yourself until your elbows are bent between 45 and 90 degrees. Control the movement throughout the range of motion.Push yourself back up slowly until your arms are almost straight, and repeat.",
