    "E_Arm_Circles_Counterclockwise": "Stand straight with your feet shoulder-width apart.Raise and extend your arms to the sides without bending the elbows.Slowly rotate your arms forward, making small circles of about 1 foot in diameter.Complete a set in one direction and then switch, rotating backward.",
