    "E_Chest_Press_Pulse": "Hold your forearms together at shoulder height and bend your elbows with your hands together to make an ""L"" shape.Then lift your forearms up and down.",
    "E_Modified_Burpees": "Start from a high plank position. Rather than jumping into a low squat, you will want to walk one foot to the outside of your hand and then walk your second foot into the outside of that hand.Find the bottom of your squat, stand up with your chest tall, with NO jump at the top.Firmly place your hands back down to the ground in a low squat, and step each foot back finding your high plank again",
    "E_Wall_Sit": "Lean against a wall and slide down into a squat with your knees at a 90 degree angle. And your thighs parallel to the floor. Keep your back flat against the wall",
