    "E_Right_Quad_Stretch_With_Wall": "Fold up a mat or towel and place it in front of a wall.Kneel down and place your right knee on the towel and your shin against the wall. Point your toes so the top of your left foot is against the wall. If this is too hard, or it hurts your knee, move the towel a few inches away from the wall.Place your right foot on the ground about 12 to 18 inches away from the wall, so it's directly underneath your right knee.Press into your right foot and lean your torso back against the wall to intensify the stretch.Stay here for at least 30 seconds. Then slowly release and do this stretch with your right foot against the wall.",
