    "E_Kneeling_Lunge_Stretch_Left": "This is the start position of the kneeling hip flexor stretch. Keeping the torso upright, slowly lean forward until you feel a comfortable stretch through the groin and top of the thigh (rear leg). Move slowly back and forth 5-10 times, or maintain a hold for 30 seconds",
