    "E_Split_Squat_Left": "Stand in a split stance with your front heel 2–4 feet in front of your back foot. Raise your back heel to place weight evenly along your toes. The weight on your front foot should be evenly distributed along the entire foot. Grip the floor with your front foot to create a stable foot position",

    "E_Standing_Biceps_Stretch_Left": "Start by standing up straight, extending your arms behind you and grabbing your hands together behind your back.Slowly raise your arms, turn your hands so that your palms are facing outward, and feel a stretch in your bicep.Hold for 15 to 30 seconds then return back to the starting position.Repeat for as many reps and duration as desired.",
    "E_Standing_Biceps_Stretch_Right": "Start by standing up straight, extending your arms behind you and grabbing your hands together behind your back.Slowly raise your arms, turn your hands so that your palms are facing outward, and feel a stretch in your bicep.Hold for 15 to 30 seconds then return back to the starting position.Repeat for as many reps and duration as desired.",
    "E_Sumo_Squat": "Stand with your feet slightly wider than hip-width apart, your toes pointing outward at about 45 degrees. Your hips should be rotated outward, too. This is the starting position.Inhale while pushing your hips back and lowering into a squat position. Keep your core tight, back straight, and knees forward during this movement.Exhale while returning to the starting position. Focus on keeping your weight evenly distributed throughout your heel and midfoot",
    "E_Backward_Lunge": "Stand upright, with your hands at your hips. 2. Take a large step backward with your left foot. 3. Lower your hips so that your right thigh (front leg) becomes parallel to the floor with your right knee positioned directly over your ankle",
    "E_Standing_Glute_Kickbacks_Right": "Start by standing up straight, extending your arms behind you and grabbing your hands together behind your back.Slowly raise your arms, turn your hands so that your palms are facing outward, and feel a stretch in your bicep.Hold for 15 to 30 seconds then return back to the starting position.Repeat for as many reps and duration as desired.",
    "E_Standing_Glute_Kickbacks_Left": "Start by standing up straight, extending your arms behind you and grabbing your hands together behind your back.Slowly raise your arms, turn your hands so that your palms are facing outward, and feel a stretch in your bicep.Hold for 15 to 30 seconds then return back to the starting position.Repeat for as many reps and duration as desired.",
    "E_Butt_Bridge": "Lie on your back with knees bent and feet flat on the floor. Put your arms flat at your sides.Then lift your butt up and down.",
    "E_Wall_push_ups": "Stand in front of a wall one big step away from it. Then put your hands out straight towards the wall and lean against it. Lift your heels.Slowly bend your elbows and press your upper body towards the wall. Push back and repeat the exercise. Remember to keep your body straight.",
    "E_Arm_Circless": "Stand on the floor with your arms extended straight out the the sides at shoulder height.Move your arms forward in circles, and then move backwards.",
    "E_Jumping_Squats": "Start standing with feet hip distance apart and lower into a squat position by bending the knees. Keep the spine straight, chest lifted, and knees behind toes. Arms are in front of the chest for balance.Jump straight up and swing arms overhead. Return to squat.",


