    "E_High_Step": "Corre en el lugar mientras levantas las rodillas lo más alto posible con cada paso. Mantén la parte superior del cuerpo erguida durante este ejercicio.",
    "E_SIDE_HOP": "Párate en el piso, pon tus manos frente a ti y salta de lado a lado",
    "E_SQUATS": "Párate con los pies separados a la altura de los hombros y los brazos estirados hacia delante, luego baja el cuerpo hasta que los muslos queden paralelos al suelo"
        "Tus rodillas deben estar extendidas en la misma dirección que los dedos de tus pies. Vuelve a la posición inicial y haz la siguiente repetición"
        "Esto trabaja los muslos, las caderas, las nalgas, los cuádriceps, los isquiotibiales y la parte inferior del cuerpo",
    "E_WALL_PUSH_UP": "Párate frente a una pared a un paso grande de ella. Luego, extiende las manos directamente hacia la pared e inclínate contra ella. Levanta los talones"
        "Doble lentamente los codos y presione la parte superior del cuerpo contra la pared. Empuje hacia atrás y repita el ejercicio. Recuerde mantener el cuerpo recto",
    "E_FIRE_HYDRANT_LEFT": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos debajo de los hombros. Luego levanta la pierna izquierda hacia un lado en un ángulo de 90 grados.",
    "E_FIRE_HYDRANT_RIGHT": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos debajo de los hombros. Luego levanta la pierna derecha hacia un lado en un ángulo de 90 grados.",
    "E_PLANK": "Acuéstate en el suelo con los dedos de los pies y los antebrazos en el suelo. Mantén el cuerpo recto y mantén esta posición todo el tiempo que puedas. Este ejercicio fortalece el abdomen, la espalda y los hombros.",
    "E_COBRA_STRETCH": "Ponte de pie en el piso, luego corre en el lugar mientras levantas tus piernas para tocar tu trasero con cada paso. Intenta hacerlo lo más rápido que puedas. Es un gran ejercicio para los glúteos y los isquiotibiales",
    "E_CHILD_POSE": "Párese con los pies separados al ancho de los hombros y los brazos estirados hacia adelante, luego baje el cuerpo hasta que los muslos queden paralelos al piso. Las rodillas deben estar extendidas en la misma dirección que los dedos de los pies. Vuelva a la posición inicial y haz la siguiente repetición.",
    "E_BUTT_BRIDGE": "Recuéstate boca arriba con las rodillas dobladas y los pies apoyados en el piso. Coloca los brazos planos a los costados. Luego levanta el trasero hacia arriba y hacia abajo",
    "E_KNEE_TO_CHEST_STRETCH_LEFT": "Párate frente a una pared a un paso grande de ella. Luego, extiende las manos directamente hacia la pared e inclínate contra ella. Levanta los talones. Doble los codos lentamente y presiona la parte superior del cuerpo contra la pared. Empuja hacia atrás y repite el ejercicio. Recuerda mantener el cuerpo recto.",
    "E_KNEE_TO_CHEST_STRETCH_RIGHT": "Recuéstate boca arriba con las rodillas dobladas y los pies apoyados en el piso. Coloca los brazos planos a los costados. Luego levanta el trasero hacia arriba y hacia abajo",
    "E_Jumping_Jacks": "Acuéstate boca abajo y dobla los codos con las manos debajo de los hombros. Luego levanta el pecho del suelo tanto como puedas. Mantén esta posición durante unos segundos.",
    "E_Heel_Touch": "Empieza con los pies juntos y los brazos a los lados, luego salta con los pies separados y las manos por encima de la cabeza. Vuelve a la posición inicial y haz la siguiente repetición. Este ejercicio proporciona un entrenamiento de cuerpo completo y funciona todos tus grandes grupos musculares.",
    "E_Bird_Dog": "Empieza con las rodillas debajo del trasero y las manos debajo de los hombros. Luego estira la pierna derecha y el brazo izquierdo al mismo tiempo. Mantén la posición durante cinco segundos, luego regresa y repite con el otro lado.",

    "E_Reverse_Crunches": "Recuéstate boca arriba con las rodillas hacia arriba en un ángulo de 90 grados y las manos detrás de la cabeza. Levanta la parte superior del cuerpo y los muslos, y luego estírate. Repite este ejercicio.",
    "E_Leg_Raises": "Recuéstate boca arriba y coloca las manos debajo de las caderas para apoyarte. Luego levanta las piernas hasta que formen un ángulo recto con el suelo. Lentamente vuelve a bajar las piernas y repite el ejercicio.",
    "E_Butt_Kicks": "Ponte de pie en el piso, luego corre en el lugar mientras levantas tus piernas para tocar tu trasero con cada paso. Intenta hacerlo lo más rápido que puedas. Es un gran ejercicio para los glúteos y los isquiotibiales",
    "E_Lying_Twist_Stretch_Left": "Recuéstate boca arriba con las piernas estiradas y los brazos estirados a los costados. Levanta las rodillas y gira las piernas hacia la izquierda. Mantén esta posición",
    "E_Lying_Twist_Stretch_Right": "Recuéstate boca arriba con las piernas estiradas y los brazos estirados a los costados. Levanta las rodillas y gira las piernas hacia la derecha. Mantén esta posición.",
    "E_Mountain_Climber": "Empieza en la posición de lagartija. Dobla la rodilla derecha hacia el pecho y mantén la pierna izquierda estirada, luego cambia rápidamente de una pierna a la otra. Este ejercicio fortalece múltiples grupos musculares.",
    "E_Donkey_Kicks_Left": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos debajo de los hombros. Luego levanta la pierna izquierda y aprieta el trasero tanto como puedas. Vuelve a la posición inicial y repite el ejercicio.",
    "E_Donkey_Kicks_Right": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos debajo de los hombros. Luego levanta la pierna derecha y aprieta el trasero tanto como puedas. Vuelve a la posición inicial y repite el ejercicio.",
    "E_Burpees": "Párate con los pies separados a la altura de los hombros, luego pon las manos en el suelo y patea los pies hacia atrás. Haz una flexión rápida y salta",
    "E_Flutter_Kicks": "Recuéstate boca arriba con el brazo a los costados. Levanta las piernas y mantenlas lo más rectas que puedas. Luego levanta rápidamente la pierna derecha y, al mismo tiempo, baja la pierna izquierda. Cambia de pierna y repite.",
    "E_Inchworms": "Empieza con los pies separados a la altura de los hombros. Dobla el cuerpo y mueve las manos delante de ti lo más rápido que puedas, luego mueve las manos hacia atrás. Repite el ejercicio.",
    "E_Skipping_Without_Rope": "Coloca tus brazos a los costados y finge sostener un mango de cuerda para saltar en cada mano. Salta y aterriza alternativamente sobre las puntas de los pies, girando las muñecas al mismo tiempo como si estuvieras girando una cuerda",
    "E_Lying_Butterfly_Stretch": "Recuéstate en el suelo con los geet juntos. Abre las rodillas hacia los lados. Mantén esta posición",
    "E_Lunges": "Dar un paso adelante, bajar el cuerpo hacia el suelo y volver a la posición inicial",
    "E_Claps_Over_Head": "Para comenzar el ejercicio, levanta los brazos por encima de la cabeza mientras giras las manos de modo que las palmas de las manos queden una frente a la otra cuando los brazos estén por encima de la cabeza, de modo que puedas aplaudir. Baja los brazos hacia abajo, girando las palmas hacia abajo de nuevo, y deteniéndose a la altura de los hombros antes de repetir el ejercicio para volver a elevarlos por encima de la cabeza. Repite este movimiento mientras dure el ejercicio.",
    "E_Adductor_Stretch_In_Standing": "Párate erguido con el pecho erguido y el centro apretado. Tus pies deben estar separados a la altura de los hombros. Da un paso directamente hacia la izquierda, dejando el pie derecho en su lugar. Dobla la rodilla izquierda y haz una pausa una vez que la parte superior del muslo izquierdo esté paralela al suelo. ...",
    "E_Standing_Bicycle_Crunches": "Abdominales de bicicleta de pie Coloque los pies separados al ancho de los hombros con las manos detrás de la cabeza, luego doble la rodilla derecha y levántela hacia el codo izquierdo. Apriete el torso y el oblicuo mientras realiza el movimiento",
    "E_Side_Lying_Leg_Lift_Left": "Recuéstese de costado con la cabeza apoyada en el brazo derecho. Levante la parte superior de la pierna y regrese a la posición inicial. Asegúrese de que la pierna izquierda suba y baje recta durante el ejercicio. Es un gran ejercicio para el glúteo.",
    "E_Side_Lying_Leg_Lift_Right": "Recuéstese de costado con la cabeza apoyada en el brazo izquierdo. Levante la parte superior de la pierna y regrese a la posición inicial. Asegúrese de que la pierna derecha suba y baje recta durante el ejercicio. Es un gran ejercicio para el glúteo.",
    "E_Arm_Scissors": "Ponte de pie con los pies separados a la altura de los hombros. Estira los brazos frente a ti a la altura de los hombros con un brazo superpuesto al otro en la forma de la letra ""X"" y luego sepáralos. Cambia de brazo , y repite el ejercicio.",
    "E_Side_Lunges": "Párate derecho con los pies juntos. Mueve la pierna derecha hacia un lado, luego baja el cuerpo mientras mantienes la pierna izquierda recta. Vuelve a la posición inicial y cambia al otro lado.",
    "E_Crunch_Kicks": "Recuéstate boca arriba con los brazos a los costados y los hombros ligeramente levantados. Levanta las piernas del piso, dobla las rodillas y jálalas hacia el pecho Patea los pies hacia adelante y repite",
    "E_Abdominal_Crunches": "Acuéstese boca arriba con las rodillas dobladas y la",


    "E_Slow_Mountain_Climber": "Empieza en la posición de lagartija. Dobla la rodilla izquierda hacia el pecho y mantén la pierna derecha estirada. Luego vuelve a la posición inicial lentamente y cambia a la otra pierna.",
    "E_Russian_Twist": "Siéntate en el suelo con las rodillas dobladas, los pies un poco levantados y la espalda inclinada hacia atrás. Luego junta las manos y gíralas de un lado a otro.",


    "E_Leg_In_Outs": "Siéntate con las manos detrás de ti en el suelo, las piernas extendidas y la parte superior del cuerpo inclinada hacia atrás. Dobla las rodillas y llévalas hacia el pecho, luego extiende las piernas por completo sin tocar el suelo. Repite el ejercicio. .",
    "E_Starfish_Crunch": "Recuéstate boca arriba con las manos estiradas a los costados. Mantén las piernas separadas con los pies más separados que el ancho de los hombros. Levanta la pierna izquierda, levanta ligeramente los hombros del piso y alcanza la mano derecha para tocar el pie izquierdo. Vuelve a la posición inicial y repite con el otro lado.",
    "E_Reclinded_Oblique_Twist": "Recuéstese boca arriba con las piernas extendidas y los codos directamente debajo de los hombros. Levante la pierna izquierda en un ángulo de 45 grados mientras estira el brazo derecho hacia el lado izquierdo. Luego regrese lentamente a la posición inicial . Repite varias veces y luego cambia al otro lado.",
    "E_Plank_Hip_Dips": "Empieza en una posición de plancha estándar. Gira la columna hacia el lado izquierdo hasta que la pierna izquierda toque el suelo, luego gira hacia el otro lado. Repite el ejercicio.",
    "E_Bicycle_Crunches": "Abdominales de bicicleta Acuéstese en el suelo con las manos detrás de las orejas. Levante las rodillas y cierre el codo derecho hacia la rodilla izquierda, luego cierre el codo izquierdo hacia la rodilla derecha. Repita el ejercicio.",
    "E_Glute_Kickback_Crossover_With_Left_Leg": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos directamente debajo de los hombros. Levanta la pierna izquierda hacia atrás, luego bájala hacia el lado derecho. Levántala de nuevo y bájala hacia abajo",
    "E_Glute_Kickback_Crossover_With_Right_Leg": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos directamente debajo de los hombros. Levanta la pierna derecha hacia atrás, luego bájala hacia el lado izquierdo. Levántala de nuevo y bájala hacia abajo",
    "E_Prone_Flutter_Kicks": "Recuéstate boca abajo con las piernas extendidas y la barbilla apoyada en los brazos. Levanta las piernas del suelo y luego levanta las piernas izquierda y derecha alternativamente.",


    "E_Bent_Knee_Side_Hip_Raises_Left": "Recuéstate sobre tu lado derecho con el codo hacia abajo en el piso y las rodillas dobladas. Coloca la mano izquierda sobre las caderas. Levanta las caderas lo más alto que puedas y luego déjalas caer sin tocar el piso. Repite el ejercicio.",
    "E_Bent_Knee_Side_Hip_Raises_Right": "Recuéstate sobre tu lado izquierdo con el codo apoyado en el suelo y las rodillas dobladas. Coloca la mano derecha sobre las caderas. Levanta las caderas lo más alto que puedas y luego déjalas caer sin tocar el suelo. Repite el ejercicio. .",
    "E_Butterfly_Bridge": "Recuéstate boca arriba con los brazos a los costados y las rodillas dobladas y abiertas a los lados. Aprieta y levanta las caderas del suelo, y junta las rodillas, luego regresa a la posición inicial. Repite el ejercicio .",
    "E_Pilates_Clamshell_Left": "Recuéstate sobre tu lado derecho con la cabeza apoyada en el brazo derecho y las rodillas dobladas. Levanta la rodilla izquierda hacia arriba mientras los talones se tocan, luego vuelve a la posición inicial. Repite el ejercicio.",
    "E_Pilates_Clamshell_Right": "Recuéstate sobre tu lado izquierdo con la cabeza apoyada en el brazo izquierdo y las rodillas dobladas. Levanta la rodilla derecha hacia arriba mientras los talones se tocan, luego vuelve a la posición inicial. Repite el ejercicio.",
    "E_Donkey_Kicks_Left_Pulse": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos debajo de los hombros. Luego levanta la pierna izquierda con la rodilla en un ángulo de 90 grados hasta que el muslo quede paralelo al suelo. Aprieta el trasero y levanta tu rodilla izquierda arriba y abajo rítmicamente.",
    "E_Donkey_Kicks_Right_Pulse": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos debajo de los hombros. Luego levanta la pierna derecha con la rodilla en un ángulo de 90 grados hasta que el muslo quede paralelo al suelo. Aprieta el trasero y levanta su rodilla derecha arriba y abajo rítmicamente.",
    "E_Froggy_Glute_Lifts": "Recuéstate boca abajo con las rodillas dobladas y los talones juntos. Luego levanta los pies hacia arriba y hacia abajo. El ejercicio es muy efectivo para apretar el trasero",
    "E_Glute_Kickback_Pulse_Left": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos debajo de los hombros. Levanta la pierna izquierda hacia atrás con los dedos de los pies hacia abajo. Levanta la pierna levantada arriba y abajo rítmicamente.",
    "E_Glute_Kickback_Pulse_Right": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos debajo de los hombros. Levanta la pierna derecha hacia atrás con los dedos de los pies hacia abajo. Levanta la pierna levantada arriba y abajo rítmicamente.",
    "E_Plie_Squats": "Párate con las manos en las caderas y los pies separados un poco más que el ancho de los hombros. Luego baja el cuerpo hasta que los muslos queden paralelos al suelo. Las rodillas deben extenderse en la misma dirección que las puntas de los pies.",
    "E_Frog_Press": "Recuéstate boca arriba con las piernas levantadas, las rodillas dobladas y los talones juntos. Coloca los brazos planos a los lados. Estira las piernas y llévalas a la posición inicial. Repite el ejercicio.",
    "E_Side_Leg_Circles_Left": "Recuéstate sobre tu lado derecho con la cabeza apoyada en la mano derecha. Luego levanta la pierna izquierda y gira el pie en círculos.",
    "E_Side_Leg_Circles_Right": "Recuéstate sobre tu lado izquierdo con la cabeza apoyada en tu mano izquierda. Luego levanta la pierna derecha y gira el pie en círculos.",
    "E_Glute_Kick_Back_Left": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos directamente debajo de los hombros. Luego patea una pierna hacia atrás hasta que quede paralela al suelo. Cambia al otro lado después de varias series",
    "E_Glute_Kick_Back_Right": "Empieza a cuatro patas con las rodillas debajo del trasero y las manos directamente debajo de los hombros. Luego patea una pierna hacia atrás hasta que quede paralela al suelo. Cambia al otro lado después de varias series.",
    "E_Bottom_Leg_Lift_Left": "Recuéstate sobre tu lado izquierdo con la cabeza apoyada en la mano izquierda. Luego, coloca el pie derecho hacia adelante en el suelo. Levanta la pierna izquierda hacia arriba y hacia abajo.",
    "E_Bottom_Leg_Lift_Right": "Recuéstate sobre tu lado derecho con la cabeza apoyada en la mano derecha. Luego, coloca el pie izquierdo hacia adelante en el suelo. Levanta la pierna derecha hacia arriba y hacia abajo.",
    "E_Straight_Leg_Fire_Hydrant_Left": "Comience con las manos debajo de los hombros, la rodilla derecha directamente debajo del trasero y la pierna izquierda estirada y apoyada en el suelo. Levante la pierna izquierda hacia el lado izquierdo. Vuelva a la posición inicial y repita el ejercicio. ",
    "E_Straight_Leg_Fire_Hydrant_Right": "Comience con las manos debajo de los hombros, la rodilla izquierda directamente debajo del trasero y la pierna derecha estirada y apoyada en el suelo. Levante la pierna derecha hacia el lado derecho. Vuelva a la posición inicial y repita el ejercicio. ",
    "E_Scissors": "Levanta las piernas y cruza el muslo derecho sobre el izquierdo, luego invierte el ejercicio.Asegúrate de que tu espalda esté siempre plana.Es un gran ejercicio para los oblicuos y el recto abdominal.",
    "E_Curtsy_Lunges": "Párate derecho. Luego da un paso atrás con la pierna izquierda hacia la derecha y dobla las rodillas al mismo tiempo. Vuelve a la posición inicial y cambia al otro lado.",
    "E_Heel_To_The_Heavens": " Este ejercicio apunta a que tus abdominales inferiores se acuesten boca arriba con las manos a los costados y las piernas hacia el techo. Levanta las caderas del piso. Regresa y repite",
    "E_Cross_Knee_Plank": "Comience en una posición de tabla con los hombros sobre las muñecas, los pies juntos y el cuerpo en línea recta. Tire de la rodilla derecha debajo del vientre para tocar el codo izquierdo y luego suéltela para volver a la posición inicial. Ahora tire de su rodilla izquierda debajo de su vientre para tocar su codo derecho, luego suelte de nuevo a la posición inicial. Continúe con el número deseado de repeticiones. Mantenga los abdominales contraídos y mantenga el control del cuerpo.",
    "E_Cross_Arm_Crunches": "Recuéstese boca arriba con las rodillas dobladas. Cruce la pierna derecha sobre la rodilla izquierda y sostenga la cabeza con la mano izquierda. Haga abdominales y cruce el codo izquierdo sobre el cuerpo y hacia la rodilla derecha. Repite tantas repeticiones como puedas y cambia de lado.",
    "E_X_Man_Crunch": "Comienza a pararte con ambos pies en el piso separados al ancho de los hombros. Coloca ambas manos detrás de la cabeza. Mientras mantienes la pierna derecha extendida, dobla la rodilla izquierda y llévala hacia tu pecho. rodilla derecha para volver a la posición inicial.",
    "E_V_Hold": "Túmbate boca arriba con los brazos por encima de la cabeza. Levanta los brazos, los hombros y las piernas del suelo y mantén esta posición levantada contrayendo los abdominales. Extiende los brazos hacia las espinillas mientras mantienes una columna fuerte",
    "E_Side_Crunches_Left": "Párate sosteniendo una mancuerna, una pesa rusa o incluso un libro pesado a tu lado con una mano, con la palma hacia adentro. Dobla el torso del lado en el que estás sosteniendo el peso. Devuelve el peso a tu lado, erguido .",
    "E_Side_Crunches_Right": "Párate sosteniendo una mancuerna, una pesa rusa o incluso un libro pesado a tu lado con una mano, con la palma hacia adentro. Dobla el torso hacia el lado en el que sostienes el peso. Devuelve el peso a tu lado, erguido .",
    "E_Punches": "Párate con una de tus piernas hacia adelante y las rodillas ligeramente flexionadas. Dobla los codos y aprieta los puños frente a tu cara. Extiende un brazo hacia adelante con la palma hacia el piso. Lleva el brazo hacia atrás y repite con el otro brazo.",
    "E_Seated_Overhead_Tricep_Extension": "Siéntate en un banco con la espalda recta. Con cuidado, haz un puño con ambas manos y júntalas. Levanta las manos por encima de la cabeza, luego bájalas detrás de la cabeza. Levántalas de nuevo y repite el ejercicio",
    "E_Dynamic_Chest": "Párate en el suelo con los pies separados a la altura de los hombros. Extiende los brazos hacia adelante a la altura de los hombros con las palmas de las manos una frente a la otra. Extiende los brazos lo más que puedas y luego muévelos hacia el frente. Repite el ejercicio .",
    "E_Heep_Touch": "Acuéstate con la espalda en el suelo y las rodillas dobladas y apuntando hacia el techo. Con los brazos a los costados, levanta los hombros ligeramente del suelo. Usando los abdominales, gira la mano derecha hacia el pie derecho y luego retrocede.Luego haz lo mismo con tu mano izquierda.",
    "E_Side_Arm_Raise": "Párate con los pies separados a la altura de los hombros. Levanta los brazos a los lados a la altura de los hombros y luego bájalos. Repite el ejercicio. Mantén los brazos rectos durante el ejercicio.",
    "E_Triceps_Kickbacks": "Inclínate hacia adelante, dobla las rodillas y los codos. Extiende los brazos hacia atrás y aprieta los tríceps. Haz que los brazos queden paralelos al suelo cuando los extiendas. Vuelve a la posición inicial y repite este ejercicio",
    "E_Shoulder_Gators": "Párate erguido con las manos junto a las orejas y los codos mirando hacia cada lado. Gira los codos hasta que ambos estén mirando hacia el frente.",
    "Knee_Push_ups": "Arrodíllate en el piso. Extiende los brazos y coloca las manos separadas al ancho de los hombros en el piso frente a ti. Aprieta los abdominales mientras doblas los brazos, bajando el torso hasta que el pecho roce el piso. Empuja el torso hacia arriba estirando los brazos . Lento y constante, cariño. Enjuaga y repite.",
    "E_Triceps_Dips": "Siéntate en el borde de una silla estable, un banco de pesas o un escalón y sujeta el borde al lado de tus caderas. Tus dedos deben apuntar hacia tus pies, tus piernas extendidas y tus pies separados al ancho de tus caderas, con los talones tocando el suelo. Mire hacia adelante con la barbilla hacia arriba. Presione las palmas de las manos para levantar el cuerpo y deslícese hacia adelante lo suficiente como para que el trasero no toque el borde de la silla. Baje hasta que los codos estén doblados entre 45 y 90 grados. Controla el movimiento en todo el rango de movimiento. Empújate lentamente hacia arriba hasta que tus brazos estén casi rectos y repite",
    "E_Arm_Circles_Clockwise": "Párate derecho con los pies separados al ancho de los hombros. Levanta y extiende los brazos hacia los lados sin doblar los codos. Gira lentamente los brazos hacia adelante, formando pequeños círculos de aproximadamente 1 pie de diámetro. Completa una serie en una dirección y luego cambiar, girando hacia atrás.",
    "E_Arm_Circles_Counterclock": "Párese derecho con los pies separados al ancho de los hombros. Levante y extienda los brazos hacia los lados sin doblar los codos. Gire lentamente los brazos hacia adelante, formando pequeños círculos de aproximadamente 1 pie de diámetro. Complete una serie en una dirección y luego cambiar, girando hacia atrás.",
    "E_Alternating_Hooks": "Párate en una postura escalonada con tu pierna izquierda ligeramente hacia adelante y ambos puños protegiendo tu cara. Lleva tu mano derecha hacia atrás a tu lado y golpea alrededor con un movimiento de gancho mientras giras tu pie derecho",
    "E_Up_And_Down_Plank": "Comienza en posición de plancha, con las muñecas debajo de los hombros y los pies separados a la altura de las caderas. Dobla el brazo izquierdo, coloca el codo izquierdo sobre la colchoneta y luego dobla el brazo derecho y coloca el codo derecho sobre el tapete.Coloque su mano izquierda sobre el tapete, estire su brazo izquierdo y luego coloque su mano derecha sobre el tapete y estire su brazo derecho.Cambie de lado y repita este movimiento hacia arriba y hacia abajo hasta que el juego esté completo.",
    "E_Triceps_Stretch_Left": "Lleva tu brazo derecho a través de tu cuerpo.Dobla un poco tu codo.Usa tu mano izquierda para guiar el movimiento mientras presionas tu brazo contra tu pecho y hacia la derecha.Mantén este estiramiento durante 30 segundos y haz de tres a cuatro repeticiones",
    "E_Triceps_Stretch_Right": "Empiece parándose derecho, extendiendo los brazos detrás de usted y juntando las manos detrás de la espalda. Levante lentamente los brazos, gire las manos de modo que las palmas de las manos queden hacia afuera y sienta un estiramiento en los bíceps. Sostenga durante 15 a 30 segundos y luego regrese a la posición inicial. Repita tantas repeticiones y la duración que desee.",
    "E_Chest_Press_Pulse": "Mantén los antebrazos juntos a la altura de los hombros y dobla los codos con las manos juntas para formar una ""L"". Luego levanta los antebrazos hacia arriba y hacia abajo.",
    "E_Modified_Burpees": "Empiece desde una posición de tabla alta. En lugar de saltar a una sentadilla baja, querrá caminar con un pie hacia la parte externa de su mano y luego con el segundo pie hacia la parte externa de esa mano. Encuentre la parte inferior de ponerse en cuclillas, levántese con el pecho erguido, SIN saltos en la parte superior. Vuelva a colocar firmemente las manos en el suelo en una sentadilla baja, y retroceda cada pie para encontrar su tabla alta nuevamente",
    "E_Wall_Sit": "Apóyate contra una pared y deslízate hacia abajo para hacer una sentadilla con las rodillas en un ángulo de 90 grados. Y los muslos paralelos al suelo. Mantén la espalda pegada a la pared",
    "E_Left_Quad_Stretch_With_Wall": "Dobla una colchoneta o una toalla y colócala frente a una pared. Arrodíllate y coloca la rodilla derecha sobre la toalla y la espinilla contra la pared. Apunta los dedos de los pies de modo que la parte superior del pie derecho quede contra la pared. Si esto es demasiado duro o le duele la rodilla, mueva la toalla unos centímetros lejos de la pared. Presiona con el pie izquierdo e inclina el torso hacia atrás contra la pared para intensificar el estiramiento. Quédate así durante al menos 30 segundos. Luego suelta lentamente y haz este estiramiento con el pie izquierdo contra la pared",
    "E_Right_Quad_Stretch_With_Wall": "Dobla una colchoneta o una toalla y colócala frente a una pared. Arrodíllate y coloca la rodilla derecha sobre la toalla y la espinilla contra la pared. Apunta los dedos de los pies de manera que la parte superior del pie izquierdo quede contra la pared. Si esto es demasiado duro o le duele la rodilla, mueva la toalla unos centímetros lejos de la pared. Presiona con el pie derecho e inclina el torso hacia atrás contra la pared para intensificar el estiramiento. Quédate así durante al menos 30 segundos. Luego suelta lentamente y haz este estiramiento con el pie derecho contra la pared, 5 -10 veces, o manténgalo presionado durante 30 segundos,5 -10 veces, o manténgalo presionado durante 30 segundos",
    "E_Split_Squat_Right": "Párese en una postura dividida con el talón delantero de 2 a 4 pies por delante del pie trasero. Levante el talón trasero para colocar el peso uniformemente a lo largo de los dedos de los pies. El peso del pie delantero debe distribuirse uniformemente a lo largo de todo el pie. pie. Agarre el suelo con el pie delantero para crear una posición estable del pie",
    "E_Split_Squat_Left": "Párese en una postura dividida con el talón delantero de 2 a 4 pies por delante del pie trasero. Levante el talón trasero para colocar el peso uniformemente a lo largo de los dedos de los pies. El peso del pie delantero debe distribuirse uniformemente a lo largo de todo el pie. pie. Agarre el suelo con el pie delantero para crear una posición estable del pie",

    "E_Standing_Biceps_Stretch_Left": "Empiece parándose derecho, extendiendo los brazos detrás de usted y juntando las manos detrás de la espalda. Levante lentamente los brazos, gire las manos de modo que las palmas de las manos queden hacia afuera y sienta un estiramiento en los bíceps. Sostenga durante 15 a 30 segundos y luego regrese a la posición inicial. Repita tantas repeticiones y la duración que desee.",
    "E_Standing_Biceps_Stretch_Right": "Empiece parándose derecho, extendiendo los brazos detrás de usted y juntando las manos detrás de la espalda. Levante lentamente los brazos, gire las manos de modo que las palmas de las manos queden hacia afuera y sienta un estiramiento en los bíceps. Sostenga durante 15 a 30 segundos y luego regrese a la posición inicial. Repita tantas repeticiones y la duración que desee.",
    "E_Sumo_Squat": "Párate con los pies ligeramente más separados que el ancho de las caderas, los dedos de los pies apuntando hacia afuera a unos 45 grados. Tus caderas también deben rotarse hacia afuera. Esta es la posición inicial. Inhala mientras empujas las caderas hacia atrás y bajas una posición en cuclillas. Mantenga su núcleo apretado, la espalda recta y las rodillas hacia adelante durante este movimiento. Exhale mientras regresa a la posición inicial. Concéntrese en mantener su peso distribuido uniformemente en todo el talón y la parte media del pie",
    "E_Backward_Lunge": "Ponte de pie, con las manos en las caderas. 2. Da un gran paso hacia atrás con el pie izquierdo. 3. Baja las caderas de modo que el muslo derecho (pierna delantera) quede paralelo al suelo con la rodilla derecha colocado directamente sobre su tobillo",
    "E_Standing_Glute_Kickbacks_Right": "Empiece parándose derecho, extendiendo los brazos detrás de usted y juntando las manos detrás de la espalda. Levante lentamente los brazos, gire las manos de modo que las palmas de las manos queden hacia afuera y sienta un estiramiento en los bíceps. Sostenga durante 15 a 30 segundos y luego regrese a la posición inicial. Repita tantas repeticiones y la duración que desee.",
    "E_Standing_Glute_Kickbacks_Left": "Empiece parándose derecho, extendiendo los brazos detrás de usted y juntando las manos detrás de la espalda. Levante lentamente los brazos, gire las manos de modo que las palmas de las manos queden hacia afuera y sienta un estiramiento en los bíceps. Sostenga durante 15 a 30 segundos y luego regrese a la posición inicial. Repita tantas repeticiones y la duración que desee.",
    "E_Butt_Bridge": "Recuéstate boca arriba con las rodillas dobladas y los pies apoyados en el suelo. Pon los brazos planos a los costados. Luego levanta el trasero hacia arriba y hacia abajo.",
    "E_Wall_push_ups": "Párate frente a una pared a un paso grande de ella. Luego, extiende las manos directamente hacia la pared e inclínate contra ella. Levanta los talones. Doble los codos lentamente y presiona la parte superior del cuerpo contra la pared. Empuja hacia atrás y repite el ejercicio. Recuerda mantener el cuerpo recto.",
    "E_Arm_Circless": "Párate en el suelo con los brazos extendidos a los lados a la altura de los hombros. Mueve los brazos hacia delante en círculos y luego muévelos hacia atrás.",
    "E_Jumping_Squats": "Comienza a pararte con los pies separados a la altura de las caderas y baja a una posición de cuclillas doblando las rodillas. Mantén la columna recta, el pecho levantado y las rodillas detrás de los dedos de los pies. Los brazos están frente al pecho para mantener el equilibrio. mueve los brazos por encima de la cabeza. Vuelve a ponerte en cuclillas.",


