    "E_Bent_Knee_Side_Hip_Raises_Right": "अपनी कोहनी के बल फर्श पर बाईं ओर लेट जाएं और आपके घुटने मुड़े हुए हों। अपने दाहिने हाथ को अपने कूल्हों पर रखें। अपने कूल्हों को जितना हो सके ऊपर उठाएं, फिर उन्हें फर्श को छुए बिना नीचे गिराएं। व्यायाम दोहराएं ।",
    "E_Butterfly_Bridge": "अपनी भुजाओं के साथ अपनी पीठ के बल लेटें और आपके घुटने मुड़े हुए और भुजाओं की ओर खुले। अपने कूल्हों को ज़मीन से ऊपर उठाएँ, और अपने घुटनों को एक साथ लाएँ, फिर प्रारंभिक स्थिति में लौट आएँ। व्यायाम दोहराएं। ।",
    "E_Pilates_Clamshell_Left": "अपनी दाहिनी ओर अपने सिर के साथ अपने दाहिने हाथ पर झूठ बोलें और घुटनों को झुकाएं। अपनी एड़ी को छूते हुए अपने बाएं घुटने को ऊपर उठाएं, फिर प्रारंभिक स्थिति पर वापस जाएं। व्यायाम दोहराएं।",
    "E_Pilates_Clamshell_Right": "अपने बायीं ओर लेट जाओ, अपने सिर को अपनी बायीं भुजा पर टिकाओ और घुटनों को मोड़ो। अपनी एड़ी को छूते हुए अपने दाहिने घुटने को ऊपर उठाएं, फिर प्रारंभिक स्थिति में वापस आ जाएं। व्यायाम दोहराएं।",
    "E_Donkey_Kicks_Left_Pulse": "अपने घुटनों के साथ अपने बट के नीचे और अपने कंधों के नीचे अपने चारों ओर से शुरू करें। फिर अपने बाएं पैर को अपने घुटने से 90 डिग्री के कोण पर उठाएं जब तक कि आपकी जांघ फर्श के समानांतर न हो जाए। अपने बट को निचोड़ें, और ऊपर उठाएं आपका बायां घुटना लयबद्ध रूप से ऊपर और नीचे।",
    "E_Donkey_Kicks_Right_Pulse": "अपने घुटनों के साथ अपने बट के नीचे और अपने कंधों के नीचे अपने चारों ओर से शुरू करें। फिर अपने दाहिने पैर को अपने घुटने से 90 डिग्री के कोण पर उठाएं जब तक कि आपकी जांघ फर्श के समानांतर न हो जाए। अपने बट को निचोड़ें, और ऊपर उठाएं आपका दाहिना घुटना लयबद्ध रूप से ऊपर और नीचे।",
    "E_Froggy_Glute_Lifts": "अपने घुटनों को मोड़कर और एड़ियों को आपस में मिलाकर पेट के बल लेट जाएं। फिर अपने पैरों को ऊपर और नीचे उठाएं। यह व्यायाम आपके बट को निचोड़ने में बहुत प्रभावी है।",
    "E_Glute_Kickback_Pulse_Left": "चारों तरफ अपने घुटनों को अपने बट के नीचे और अपने हाथों को अपने कंधों के नीचे से शुरू करें। अपने बाएं पैर को अपने पैर की उंगलियों के साथ पीछे की ओर उठाएं। उठा हुआ पैर ऊपर और नीचे तालबद्ध रूप से उठाएं।",
    "E_Glute_Kickback_Pulse_Right": "चारों तरफ अपने घुटनों को अपने बट के नीचे और अपने हाथों को अपने कंधों के नीचे से शुरू करें। अपने दाहिने पैर को अपने पैर की उंगलियों के साथ पीछे की ओर उठाएं। उठा हुआ पैर ऊपर और नीचे तालबद्ध रूप से उठाएं।",
    "E_Plie_Squats": "अपने हाथों को अपने कूल्हों पर और पैरों को कंधे की चौड़ाई से थोड़ा चौड़ा करके खड़े हो जाएं। फिर अपने शरीर को तब तक नीचे करें जब तक कि आपकी जांघें फर्श के समानांतर न हों। आपके घुटनों को उसी दिशा में बढ़ाया जाना चाहिए जैसे आपके टिपटो।",
    "E_Frog_Press": "अपने पैरों को ऊपर उठाकर, घुटनों को मोड़कर और एड़ियों को एक साथ निचोड़कर अपनी पीठ के बल लेटें। अपनी भुजाओं को अपने पक्षों पर सपाट रखें। अपने पैरों को सीधा करें और उन्हें वापस प्रारंभिक स्थिति में लाएं। व्यायाम दोहराएं।",

    "E_Side_Leg_Circles_Left": "अपनी दाहिनी ओर अपने सिर को अपने दाहिने हाथ पर रखकर लेटें। फिर अपना बायां पैर उठाएं और अपने पैर को मंडलियों में घुमाएं।",
    "E_Side_Leg_Circles_Right": "अपने सिर को अपने बाएं हाथ पर टिकाकर अपनी बाईं ओर लेट जाएं। फिर अपना दायां पैर उठाएं और अपने पैर को मंडलियों में घुमाएं।",
    "E_Glute_Kick_Back_Left": "सभी चौकों पर अपने घुटनों को अपने बट के नीचे और अपने हाथों को सीधे अपने कंधों के नीचे से शुरू करें। फिर एक पैर को वापस किक करें जब तक कि यह जमीन के समानांतर न हो जाए। कई सेटों के बाद दूसरी तरफ स्विच करें।",
    "E_Glute_Kick_Back_Right": "चारों तरफ अपने घुटनों के साथ अपने बट के नीचे और अपने हाथों को सीधे अपने कंधों के नीचे से शुरू करें। फिर एक पैर को वापस किक करें जब तक कि यह जमीन के समानांतर न हो जाए। कई सेटों के बाद दूसरी तरफ स्विच करें।",
    "E_Bottom_Leg_Lift_Left": "अपने बायें हाथ पर सिर रखकर लेट जाएं। फिर अपने दाहिने पैर को फर्श पर आगे रखें। अपने बाएं पैर को ऊपर और नीचे उठाएं।",
    "E_Bottom_Leg_Lift_Right": "अपने दाहिने हाथ पर सिर रखकर लेट जाएं। फिर अपने बाएं पैर को फर्श पर आगे रखें। अपने दाहिने पैर को ऊपर और नीचे उठाएं।",
    "E_Stright_Leg_Fire_Hydrant_Left": "अपने हाथों को अपने कंधों के नीचे से शुरू करें, आपका दाहिना घुटना सीधे आपके बट के नीचे और आपका बायां पैर फैला हुआ और जमीन पर टिका हुआ है। अपने बाएं पैर को अपनी बाईं ओर उठाएं। प्रारंभिक स्थिति पर लौटें और व्यायाम दोहराएं। ",
    "E_Stright_Leg_Fire_Hydrant_Right": "अपने हाथों को अपने कंधों के नीचे से शुरू करें, आपका बायां घुटना सीधे आपके बट के नीचे और आपका दाहिना पैर फैला हुआ और जमीन पर टिका हुआ है। अपने दाहिने पैर को अपनी दाईं ओर उठाएं। प्रारंभिक स्थिति पर लौटें और व्यायाम दोहराएं। ",

    "E_Scissors": "अपने पैरों को उठाएं और बायीं ओर दाहिनी जांघ को पार करें, फिर व्यायाम को उलट दें। सुनिश्चित करें कि आपकी पीठ हमेशा सपाट रहे। यह तिरछे और रेक्टस एब्डोमिनिस के लिए एक बेहतरीन व्यायाम है।",
    "E_Curtsy_Lunges": "सीधे खड़े हो जाएं। फिर अपने बाएं पैर को दाईं ओर ले जाएं, और उसी समय अपने घुटनों को मोड़ें। प्रारंभिक स्थिति पर वापस जाएं और दूसरी तरफ स्विच करें।",
    "E_Heel_To_The_Heavens": " यह व्यायाम आपके निचले एब्स को अपनी पीठ के बल लेटकर अपने हाथों को अपनी भुजाओं और पैरों को सीधे छत की ओर लक्षित करता है। अपने कूल्हों को सीधे फर्श से ऊपर उठाएं। वापस लौटें और दोहराएं",
    "E_Cross_Knee_Plank": "एक तख़्त स्थिति में अपने कंधों के साथ अपनी कलाई, अपने पैरों को एक साथ, और अपने शरीर को एक सीधी रेखा में शुरू करें। अपनी बाईं कोहनी को छूने के लिए अपने दाहिने घुटने को अपने पेट के नीचे खींचें, फिर वापस प्रारंभिक स्थिति में छोड़ दें। अब अपनी दाहिनी कोहनी को छूने के लिए अपने बाएं घुटने को अपने पेट के नीचे खींचें, फिर प्रारंभिक स्थिति में वापस आ जाएं। वांछित संख्या में प्रतिनिधि के लिए जारी रखें। पेट को कस कर रखें और शरीर को नियंत्रण में रखें।",
    "E_Cross_Arm_Crunches": "अपने घुटनों को मोड़कर पीठ के बल लेट जाएं। अपने दाहिने पैर को बाएं घुटने के ऊपर से क्रॉस करें, और अपने सिर को बाएं हाथ से सहारा दें। क्रंच करें और अपनी बाईं कोहनी को अपने शरीर पर और दाहिने घुटने की ओर लाएं। जितना हो सके उतने प्रतिनिधि दोहराएं और किनारे बदल दें।",
    "E_X_Man_Crunch": "दोनों पैरों को फर्श पर कंधे-चौड़ाई के साथ अलग करके खड़े होना शुरू करें। दोनों हाथों को अपने सिर के पीछे रखें। अपने दाहिने पैर को बढ़ाते हुए, अपने बाएं घुटने को मोड़ें और इसे अपनी छाती की ओर खींचें। अपने धड़ को मोड़ें और अपने दाहिना घुटना प्रारंभिक स्थिति में लौटने के लिए।",
    "E_V_Hold": "अपनी बाहों के साथ अपनी पीठ के बल लेट जाएं। अपनी बाहों, कंधों और पैरों को जमीन से ऊपर उठाएं और अपने एब्डोमिनल को सिकोड़ते हुए इस उठी हुई स्थिति को पकड़ें। एक मजबूत रीढ़ बनाए रखते हुए अपनी बाहों को सीधे अपने पिंडली की ओर पहुंचाएं।",
    "E_Side_Crunches_Left": "एक हाथ से डंबल, केटलबेल या यहां तक ​​कि एक भारी किताब को अपनी तरफ पकड़कर खड़े हो जाएं, हथेली अंदर की ओर हो। अपने धड़ को उस तरफ मोड़ें जहां आप वजन पकड़ रहे हैं। सीधे खड़े होकर वजन को अपनी तरफ लौटाएं। ।",
    "E_Side_Crunches_Right": "डंबल, केटलबेल या यहां तक ​​कि एक भारी किताब को एक हाथ से पकड़कर खड़े हो जाएं, हथेली अंदर की ओर हो। अपने धड़ को उस तरफ मोड़ें जहां आप वजन पकड़ रहे हैं। वजन को अपनी तरफ लौटाएं, सीधे खड़े हों ।",
    "E_Punches": "अपने एक पैर को आगे की ओर करके खड़े हो जाएं और आपके घुटने थोड़े मुड़े हुए हों। अपनी कोहनियों को मोड़ें और अपने चेहरे के सामने अपना पहला कस लें। एक हाथ आगे बढ़ाएं, हथेली फर्श की ओर। दूसरी भुजा।",
    "E_Seated_Overhead_Tricep_Extension": "अपनी पीठ को सीधा करके एक बेंच पर बैठें। धीरे से दोनों हाथों को मुट्ठी में बनाएं और उन्हें एक साथ रखें। अपने हाथों को ऊपर उठाएं, फिर उन्हें अपने सिर के पीछे नीचे करें। उन्हें फिर से ऊपर उठाएं, और व्यायाम दोहराएं।",
    "E_Dynamic_Cest": "फर्श पर अपने पैरों को कंधे की चौड़ाई से अलग करके खड़े हो जाएं। अपनी हथेलियों को एक दूसरे के सामने रखते हुए अपनी बाहों को कंधे की ऊंचाई पर आगे बढ़ाएं। अपनी बाहों को जितना हो सके बाहर की ओर फैलाएं, फिर उन्हें वापस सामने की ओर ले जाएं। व्यायाम दोहराएं। ।",
    "E_Heep_Touch": "अपनी पीठ को जमीन पर रखकर लेट जाएं और आपके घुटने मुड़े हुए हों और छत की ओर इशारा करें। अपनी भुजाओं को अपनी तरफ करके अपने कंधों को जमीन से थोड़ा ऊपर उठाएं। अपने एब्स का उपयोग करते हुए अपने दाहिने हाथ को अपने दाहिने पैर की ओर घुमाएं और फिर बैक अप लें। फिर वही काम अपने बाएं हाथ से करें।",


    "E_Side_Arm_Raise": "अपने पैरों को कंधे की चौड़ाई से अलग करके खड़े हो जाएं। अपनी भुजाओं को कंधे की ऊंचाई पर भुजाओं तक उठाएं, फिर उन्हें नीचे रखें। व्यायाम दोहराएं। अभ्यास के दौरान अपनी बाहों को सीधा रखें।",
    "E_Triceps_Kickbacks": "आगे झुकें, अपने घुटनों और कोहनियों को मोड़ें। अपनी भुजाओं को अपने पीछे फैलाएं और अपने ट्राइसेप्स को निचोड़ें। कृपया उन्हें फैलाते समय अपनी भुजाओं को जमीन के समानांतर बनाएं। प्रारंभिक स्थिति पर वापस जाएं, और इस अभ्यास को दोहराएं।",
    "E_Shoulder_Gators": "अपने हाथों को अपने कानों के पास और कोहनियों को दोनों तरफ की ओर रखते हुए सीधे खड़े हो जाएं। अपनी कोहनियों को तब तक घुमाएं जब तक कि वे दोनों सामने की ओर न हों।",
    "E_Knee_Push_ups": "फर्श पर घुटने टेकें। बाहों को फैलाएं और हाथों को कंधे-चौड़ाई को अपने सामने फर्श पर अलग रखें। बाहों को मोड़ते समय पेट को कस लें, अपने धड़ को तब तक नीचे रखें जब तक कि छाती फर्श को न पकड़ ले। बाहों को सीधा करके धड़ को पीछे की ओर धकेलें। धीमी और स्थिर, बेबी।कुल्ला और दोहराएँ।",
    "E_Triceps_Dips": "एक स्थिर कुर्सी, वजन बेंच, या कदम के किनारे पर बैठें और अपने कूल्हों के बगल में किनारे को पकड़ें। आपकी उंगलियों को आपके पैरों पर, आपके पैरों को बढ़ाया जाना चाहिए, और आपके पैरों को हिप-चौड़ाई के अलावा अलग किया जाना चाहिए, ऊँची एड़ी के जूते जमीन को छूते हुए। अपनी ठुड्डी को ऊपर करके सीधे आगे देखें। अपने शरीर को ऊपर उठाने के लिए अपनी हथेलियों में दबाएं और इतना आगे खिसकाएं कि आपकी पीठ कुर्सी के किनारे को साफ कर दे। अपने आप को तब तक नीचे करें जब तक कि आपकी कोहनी 45 और 90 के बीच मुड़ी हुई न हो जाए। डिग्री। गति की पूरी सीमा के दौरान आंदोलन को नियंत्रित करें। अपने आप को धीरे-धीरे ऊपर उठाएं जब तक कि आपकी बाहें लगभग सीधी न हों, और दोहराएं।",
    "E_Arm_Circles_Clockwise": "अपने पैरों को कंधे-चौड़ाई से अलग करके सीधे खड़े हो जाएं। कोहनियों को झुकाए बिना अपनी भुजाओं को ऊपर उठाएं और भुजाओं तक फैलाएं। धीरे-धीरे अपनी भुजाओं को आगे की ओर घुमाएं, लगभग 1 फुट व्यास के छोटे वृत्त बनाएं। एक दिशा में एक सेट पूरा करें। और फिर पीछे की ओर घूमते हुए स्विच करें।",
    "E_Arm_Circles_ काउंटरक्लॉकवाइज": "अपने पैरों को कंधे-चौड़ाई के साथ सीधे खड़े हो जाएं। कोहनी को झुकाए बिना अपनी बाहों को पक्षों तक बढ़ाएं और बढ़ाएं। धीरे-धीरे अपनी बाहों को आगे बढ़ाएं, लगभग 1 फुट व्यास के छोटे सर्कल बनाएं। एक दिशा में एक सेट पूरा करें और फिर पीछे की ओर घूमते हुए स्विच करें।",
    "E_Alternating_Hooks": "अपने बाएं पैर को थोड़ा आगे की ओर और दोनों मुट्ठियों को अपने चेहरे की रक्षा करते हुए एक कंपित मुद्रा में खड़े हों। अपने दाहिने हाथ को वापस अपनी तरफ लाएं और अपने दाहिने पैर को घुमाते हुए एक हुकिंग गति में चारों ओर मुक्का मारें",
    "E_Up_And_Down_Plank": "एक तख़्त स्थिति में शुरू करें, अपनी कलाई अपने कंधों के नीचे और अपने पैरों को कूल्हे-चौड़ाई के साथ अलग करें। अपनी बाईं भुजा को मोड़ें, अपनी बाईं कोहनी को चटाई पर रखें और फिर अपनी दाहिनी भुजा को मोड़ें और अपनी दाहिनी कोहनी को ऊपर रखें। चटाई। अपने बाएं हाथ को चटाई पर रखें, अपने बाएं हाथ को सीधा करें और फिर अपने दाहिने हाथ को चटाई पर रखें और अपनी दाहिनी भुजा को सीधा करें। पक्षों को स्विच करें और इसे ऊपर और नीचे की गति को तब तक दोहराएं जब तक कि सेट पूरा न हो जाए। ",
    "E_Triceps_Stretch_Left": "अपनी दाहिनी भुजा को अपने शरीर पर लाएँ। अपनी कोहनी को थोड़ा मोड़ें। अपने बाएँ हाथ का उपयोग गति को निर्देशित करने के लिए करें क्योंकि आप अपनी भुजा को अपनी छाती में और दाईं ओर दबाते हैं। इस खिंचाव को 30 सेकंड तक पकड़ें और तीन से चार करें दोहराव",
    "E_Triceps_Stretch_Right": "सीधे खड़े होकर शुरू करें, अपनी बाहों को अपने पीछे फैलाएं और अपने हाथों को अपनी पीठ के पीछे एक साथ पकड़ें। धीरे-धीरे अपनी बाहों को ऊपर उठाएं, अपने हाथों को मोड़ें ताकि आपकी हथेलियां बाहर की ओर हों, और अपने बाइसेप्स में खिंचाव महसूस करें। पकड़ो। 15 से 30 सेकंड के लिए फिर प्रारंभिक स्थिति में वापस आ जाएं। जितने चाहें उतने प्रतिनिधि और अवधि के लिए दोहराएं।",

    "E_Chest_Press_Pulse": "अपने फोरआर्म्स को कंधे की ऊंचाई पर एक साथ पकड़ें और अपनी कोहनियों को अपने हाथों से एक साथ मोड़कर ""L"" शेप बनाएं। फिर अपने फोरआर्म्स को ऊपर और नीचे उठाएं।",
    "E_Modified_Burpees": "एक उच्च तख़्त स्थिति से शुरू करें। एक कम स्क्वाट में कूदने के बजाय, आप एक पैर अपने हाथ के बाहर तक चलना चाहेंगे और फिर अपने दूसरे पैर को उस हाथ के बाहर की ओर ले जाना चाहेंगे। के नीचे खोजें अपने स्क्वाट, अपनी छाती को लंबा करके खड़े हो जाओ, शीर्ष पर कोई कूद नहीं है। अपने हाथों को कम स्क्वाट में जमीन पर मजबूती से रखें, और प्रत्येक पैर को अपने उच्च फलक को फिर से ढूंढते हुए पीछे ले जाएं",
    "E_Wall_Sit": "एक दीवार के खिलाफ झुकें और 90 डिग्री के कोण पर अपने घुटनों के साथ एक स्क्वाट में नीचे स्लाइड करें। और आपकी जांघें फर्श के समानांतर। अपनी पीठ को दीवार के खिलाफ सपाट रखें",
    "E_Left_Quad_Stretch_With_Wall": "एक चटाई या तौलिये को मोड़ें और उसे दीवार के सामने रखें। घुटने टेकें और अपने दाहिने घुटने को तौलिये पर रखें और अपने पिंडली को दीवार से सटाएं। अपने पैर की उंगलियों को इंगित करें ताकि आपके दाहिने पैर का शीर्ष ऊपर की ओर हो दीवार। अगर यह बहुत कठिन है, या यह आपके घुटने को दर्द देता है, तो तौलिया को दीवार से कुछ इंच दूर ले जाएं। अपने बाएं पैर को दीवार से लगभग 12 से 18 इंच दूर जमीन पर रखें, ताकि यह सीधे आपके बाएं घुटने के नीचे हो। अपने बाएं पैर में दबाएं और खिंचाव को तेज करने के लिए दीवार के खिलाफ अपने धड़ को पीछे झुकाएं। यहां कम से कम 30 सेकंड तक रहें। फिर धीरे-धीरे रिलीज करें और दीवार के खिलाफ अपने बाएं पैर के साथ इस खिंचाव को करें।",
    "E_Right_Quad_Stretch_With_Wall": "एक चटाई या तौलिये को मोड़कर दीवार के सामने रख दें। घुटने टेकें और अपने दाहिने घुटने को तौलिये पर रखें और अपने पिंडली को दीवार से सटाएं। अपने पैर की उंगलियों को इंगित करें ताकि आपके बाएं पैर का शीर्ष आपके पैर की तरफ हो। दीवार। यदि यह बहुत कठिन है, या यह आपके घुटने को चोट पहुँचाता है, तो तौलिया को दीवार से कुछ इंच दूर ले जाएँ। अपने दाहिने पैर को दीवार से लगभग 12 से 18 इंच की दूरी पर जमीन पर रखें, ताकि यह सीधे आपके दाहिने घुटने के नीचे हो। अपने दाहिने पैर में दबाएं और खिंचाव को तेज करने के लिए दीवार के खिलाफ अपने धड़ को पीछे झुकाएं। यहां कम से कम 30 सेकंड तक रहें। फिर धीरे-धीरे रिलीज करें और दीवार के खिलाफ अपने दाहिने पैर के साथ इस खिंचाव को करें।",
    "E_Kneeling_Lunge_Stretch_Right": "यह घुटना टेककर हिप फ्लेक्सर खिंचाव की प्रारंभिक स्थिति है। धड़ को सीधा रखते हुए, धीरे-धीरे आगे झुकें जब तक कि आप कमर और जांघ के ऊपर (पीछे के पैर) के माध्यम से एक आरामदायक खिंचाव महसूस न करें। धीरे-धीरे आगे-पीछे करें 5 -10 बार, या 30 सेकंड के लिए होल्ड बनाए रखें",
    "E_Kneeling_Lunge_Stretch_Left": "यह घुटना टेककर हिप फ्लेक्सर खिंचाव की प्रारंभिक स्थिति है। धड़ को सीधा रखते हुए, धीरे-धीरे आगे झुकें जब तक कि आप कमर और जांघ के ऊपर (पीछे के पैर) के माध्यम से एक आरामदायक खिंचाव महसूस न करें। धीरे-धीरे आगे-पीछे करें 5 -10 बार, या 30 सेकंड के लिए होल्ड बनाए रखें",
    "E_Split_Squat_Right": "विभाजित मुद्रा में खड़े हो जाएं और अपनी सामने की एड़ी को अपने पिछले पैर के सामने 2-4 फीट रखें। अपने पैर की उंगलियों के साथ समान रूप से वजन रखने के लिए अपनी पीठ की एड़ी उठाएं। आपके सामने के पैर का वजन समान रूप से पूरे के साथ वितरित किया जाना चाहिए। पैर। एक स्थिर पैर की स्थिति बनाने के लिए फर्श को अपने सामने के पैर से पकड़ें",
    "E_Split_Squat_Left": "अपने पिछले पैर के सामने की एड़ी 2-4 फीट के साथ विभाजित रुख में खड़े हों। अपने पैर की उंगलियों के साथ समान रूप से वजन रखने के लिए अपनी पिछली एड़ी उठाएं। आपके सामने के पैर पर वजन समान रूप से पूरे के साथ वितरित किया जाना चाहिए पैर। एक स्थिर पैर की स्थिति बनाने के लिए फर्श को अपने सामने के पैर से पकड़ें",
