    "E_Leg_In_Outs": "Sente-se com as mãos atrás de você no chão, as pernas estendidas e a parte superior do corpo inclinada para trás. Dobre os joelhos e traga-os em direção ao peito, depois estique totalmente as pernas sem tocar o chão. Repita o exercício .",
    "E_Starfish_Crunch": "Deite-se de costas com as mãos esticadas para os lados. Mantenha as pernas afastadas com os pés mais afastados do que a largura dos ombros. Levante a perna esquerda, levante ligeiramente os ombros do chão e alcance a mão direita para tocar o pé esquerdo. Retorne à posição inicial e repita com o outro lado.",
    "E_Reclinded_Oblique_Twist": "Deite-se de costas com as pernas estendidas e os cotovelos diretamente sob os ombros. Levante a perna esquerda em um ângulo de 45 graus enquanto estende o braço direito para o lado esquerdo. Em seguida, volte lentamente à posição inicial . Repita várias vezes e, em seguida, mude para o outro lado.",
    "E_Plank_Hip_Dips": "Comece na posição de prancha padrão. Gire a coluna para o lado esquerdo até que a perna esquerda toque o chão, depois gire para o outro lado. Repita o exercício.",
    "E_Bicycle_Crunches": "Bicycle Crunches Deite-se no chão com as mãos atrás das orelhas. Levante os joelhos e feche o cotovelo direito em direção ao joelho esquerdo, depois feche o cotovelo esquerdo em direção ao joelho direito. Repita o exercício.",
    "E_Glute_Kickback_Crossover_With_Left_Leg": "Comece de quatro com os joelhos sob a bunda e as mãos diretamente sob os ombros.Levante a perna esquerda para trás e abaixe-a para o lado direito. Levante-a novamente e abaixe-a para baixo",
    "E_Glute_Kickback_Crossover_With_Right_Leg": "Comece de quatro com os joelhos sob a bunda e as mãos diretamente sob os ombros.Levante a perna direita para trás e abaixe-a para o lado esquerdo. Levante-a novamente e abaixe-a para baixo.",
    "E_Prone_Flutter_Kicks": "Deite-se de bruços com as pernas estendidas e o queixo nos braços. Levante as pernas do chão e, em seguida, levante alternadamente as pernas esquerda e direita.",

    "E_Bent_Knee_Side_Hip_Raises_Left": "Deite-se do lado direito com o cotovelo no chão e os joelhos dobrados. Coloque a mão esquerda nos quadris.Levante os quadris o mais alto que puder, depois solte-os sem tocar o chão.Repita a exercício.",
    "E_Bent_Knee_Side_Hip_Raises_Right": "Deite-se do lado esquerdo com o cotovelo no chão e os joelhos dobrados. Coloque a mão direita nos quadris. Levante os quadris o mais alto que puder, depois solte-os sem tocar o chão Repita o exercício .",
    "E_Butterfly_Bridge": "Deite-se de costas com os braços ao lado do corpo e os joelhos dobrados e abertos para os lados. Aperte e levante os quadris do chão, junte os joelhos e volte à posição inicial. Repita o exercício .",
    "E_Pilates_Clamshell_Left": "Deite-se do lado direito com a cabeça apoiada no braço direito e os joelhos dobrados. Levante o joelho esquerdo enquanto mantém os calcanhares se tocando, depois volte à posição inicial. Repita o exercício.",
    "E_Pilates_Clamshell_Right": "Deite-se do lado esquerdo com a cabeça apoiada no braço esquerdo e os joelhos dobrados. Levante o joelho direito enquanto mantém os calcanhares se tocando, depois volte à posição inicial. Repita o exercício.",
    "E_Donkey_Kicks_Left_Pulse": "Comece de quatro com os joelhos sob a bunda e as mãos sob os ombros. Em seguida, levante a perna esquerda com o joelho em um ângulo de 90 graus até que a coxa fique paralela ao chão. Aperte a bunda e levante seu joelho esquerdo para cima e para baixo ritmicamente.",
    "E_Donkey_Kicks_Right_Pulse": "Comece de quatro com os joelhos sob a bunda e as mãos sob os ombros. Em seguida, levante a perna direita com o joelho em um ângulo de 90 graus até que a coxa fique paralela ao chão. Aperte a bunda e levante seu joelho direito para cima e para baixo ritmicamente.",
    "E_Froggy_Glute_Lifts": "Deite-se de bruços com os joelhos dobrados e os calcanhares juntos. Em seguida, levante e abaixe os pés. O exercício é muito eficaz para apertar o bumbum.",
    "E_Glute_Kickback_Pulse_Left": "Comece de quatro com os joelhos sob a bunda e as mãos sob os ombros.Levante a perna esquerda para trás com os dedos dos pés voltados para baixo.Levante a perna levantada para cima e para baixo ritmicamente.",
    "E_Glute_Kickback_Pulse_Right": "Comece de quatro com os joelhos sob a bunda e as mãos sob os ombros.Levante a perna direita para trás com os dedos dos pés voltados para baixo.Levante a perna levantada para cima e para baixo ritmicamente.",
    "E_Plie_Squats": "Fique com as mãos nos quadris e os pés um pouco mais afastados do que a largura dos ombros. Em seguida, abaixe o corpo até que as coxas fiquem paralelas ao chão. Os joelhos devem estar estendidos na mesma direção das pontas dos pés.",
    "E_Frog_Press": "Deite-se de costas com as pernas levantadas, joelhos dobrados e calcanhares juntos. Coloque os braços ao longo do corpo. Estique as pernas e traga-as de volta à posição inicial. Repita o exercício.",

    "E_Side_Leg_Circles_Left": "Deite-se do lado direito com a cabeça apoiada na mão direita. Em seguida, levante a perna esquerda e gire o pé em círculos.",
    "E_Side_Leg_Circles_Right": "Deite-se do lado esquerdo com a cabeça apoiada na mão esquerda. Em seguida, levante a perna direita e gire o pé em círculos.",
    "E_Glute_Kick_Back_Left": "Comece de quatro com os joelhos sob a bunda e as mãos diretamente sob os ombros. Em seguida, chute uma perna para trás até que fique paralela ao chão. Mude para o outro lado após várias séries.",
    "E_Glute_Kick_Back_Right": "Comece de quatro com os joelhos sob a bunda e as mãos diretamente sob os ombros. Em seguida, chute uma perna para trás até ficar paralela ao chão. Mude para o outro lado após várias séries.",
    "E_Bottom_Leg_Lift_Left": "Deite-se do lado esquerdo com a cabeça apoiada na mão esquerda. Em seguida, coloque o pé direito à frente no chão. Levante a perna esquerda para cima e para baixo.",
    "E_Bottom_Leg_Lift_Right": "Deite-se do lado direito com a cabeça apoiada na mão direita. Em seguida, coloque o pé esquerdo no chão. Levante a perna direita para cima e para baixo.",
    "E_Straight_Leg_Fire_Hydrant_Left": "Comece com as mãos sob os ombros, o joelho direito diretamente sob o bumbum e a perna esquerda esticada e apoiada no chão. Levante a perna esquerda para o lado esquerdo. Retorne à posição inicial e repita o exercício. ",
    "E_Straight_Leg_Fire_Hydrant_Right": "Comece com as mãos sob os ombros, o joelho esquerdo diretamente sob o bumbum e a perna direita esticada e apoiada no chão. Levante a perna direita para o lado direito. Retorne à posição inicial e repita o exercício. ",

    "E_Scissors": "Levante as pernas e cruze a coxa direita sobre a esquerda, depois inverta o exercício. Certifique-se de que suas costas estejam sempre retas. É um ótimo exercício para os oblíquos e retos abdominais.",
    "E_Curtsy_Lunges": "Fique de pé. Em seguida, dê um passo para trás com a perna esquerda para a direita e dobre os joelhos ao mesmo tempo. Volte para a posição inicial e mude para o outro lado.",
    "E_Heel_To_The_Heavens": " Este exercício tem como alvo o abdômen inferior deitado de costas com as mãos para os lados e as pernas para cima em direção ao teto. Levante os quadris do chão. Retorne e repita",
    "E_Cross_Knee_Plank": "Comece na posição de prancha com os ombros sobre os pulsos, os pés juntos e o corpo em linha reta. Puxe o joelho direito sob a barriga para tocar o cotovelo esquerdo, depois solte de volta à posição inicial. Agora puxe o joelho esquerdo sob a barriga para tocar o cotovelo direito, depois solte de volta à posição inicial. Continue pelo número desejado de repetições. Mantenha os abdominais contraídos e mantenha o corpo no controle.",
    "E_Cross_Arm_Crunches": "Deite-se de costas com os joelhos dobrados.Cruze a perna direita sobre o joelho esquerdo e apoie a cabeça com a mão esquerda.Crunch e traga o cotovelo esquerdo em direção ao joelho direito. Repita o máximo de repetições que puder e troque de lado.",
    "E_X_Man_Crunch": "Comece em pé com os dois pés no chão na largura dos ombros. Coloque as duas mãos atrás da cabeça.Enquanto mantém a perna direita estendida, dobre o joelho esquerdo e puxe-o em direção ao peito.Destorça o tronco e estenda o joelho direito para retornar à posição inicial.",
    "E_V_Hold": "Deite-se de costas com os braços acima da cabeça. Levante os braços, ombros e pernas do chão e mantenha essa posição elevada contraindo os abdominais. Estique os braços em direção às canelas, mantendo uma coluna forte.",
    "E_Side_Crunches_Left": "Fique de pé segurando um haltere, kettlebell ou até mesmo um livro pesado ao seu lado com uma mão, palma voltada para dentro. Dobre o tronco para o lado em que você está segurando o peso. Devolva o peso ao seu lado, ficando em pé .",
    "E_Side_Crunches_Right": "Fique de pé segurando um haltere, kettlebell ou mesmo um livro pesado ao seu lado com uma mão, palma voltada para dentro. Dobre o tronco para o lado em que você está segurando o peso. Devolva o peso ao seu lado, ficando de pé .",
    "E_Punches": "Fique com uma das pernas para a frente e os joelhos levemente dobrados. Dobre os cotovelos e aperte os primeiros na frente do rosto. Estenda um braço para a frente com a palma voltada para o chão. Leve o braço para trás e repita com o outro braço.",
    "E_Seated_Overhead_Tricep_Extension": "Sente-se em um banco com as costas retas. Gentilmente feche as duas mãos em punho e junte-as. Levante as mãos sobre a cabeça e abaixe-as atrás da cabeça. Levante-as novamente e repita o exercício.",
    "E_Dynamic_Chest": "Fique no chão com os pés afastados na largura dos ombros. Estenda os braços para a frente na altura dos ombros com as palmas voltadas uma para a outra. Estenda os braços o máximo possível e, em seguida, mova-os de volta para a frente. Repita o exercício .",
    "E_Heep_Touch": "Deite-se com as costas no chão e os joelhos dobrados e apontados para o teto. Com os braços ao lado do corpo, levante os ombros ligeiramente do chão. Usando o abdômen, gire a mão direita para baixo até o pé direito e depois volte. Em seguida, faça a mesma coisa com a mão esquerda.",

    "E_Side_Arm_Raise": "Fique em pé com os pés afastados na largura dos ombros.Levante os braços para os lados na altura dos ombros, depois abaixe-os.Repita o exercício. Mantenha os braços retos durante o exercício.",
    "E_Triceps_Kickbacks": "Incline-se para a frente, dobre os joelhos e os cotovelos. Estenda os braços para trás e aperte o tríceps. Por favor, deixe os braços paralelos ao chão ao estendê-los. Volte à posição inicial e repita este exercício.",
    "E_Shoulder_Gators": "Fique de pé com as mãos ao lado das orelhas e os cotovelos voltados para cada lado. Gire os cotovelos até que ambos estejam voltados para a frente.",
    "Knee_Push_ups": "Ajoelhe-se no chão. Estenda os braços e coloque as mãos na largura dos ombros no chão à sua frente. Aperte o abdômen enquanto dobra os braços, abaixando o tronco até que o peito roce o chão. Empurre o tronco para cima esticando os braços . Devagar e com firmeza, baby. Enxágue e repita.",
    "E_Triceps_Dips": "Sente-se na beirada de uma cadeira estável, banco de musculação ou degrau e segure a borda próxima aos quadris. Seus dedos devem estar apontados para os pés, as pernas estendidas e os pés afastados na largura do quadril, com os calcanhares tocando o chão. Olhe para frente com o queixo para cima. Pressione as palmas das mãos para levantar o corpo e deslize para frente apenas o suficiente para que seu traseiro ultrapasse a borda da cadeira. Abaixe-se até que os cotovelos estejam dobrados entre 45 e 90 graus. Controle o movimento em toda a amplitude de movimento. Empurre-se para trás lentamente até que seus braços estejam quase retos e repita.",
    "E_Arm_Circles_Clockwise": "Fique em pé com os pés afastados na largura dos ombros. Levante e estenda os braços para os lados sem dobrar os cotovelos. Gire lentamente os braços para a frente, fazendo pequenos círculos de cerca de 30 cm de diâmetro. Complete uma série em uma direção e, em seguida, mude, girando para trás.",
    "E_Arm_Circles_Counterhour": "Fique em pé com os pés afastados na largura dos ombros. Levante e estenda os braços para os lados sem dobrar os cotovelos. Gire lentamente os braços para a frente, fazendo pequenos círculos de cerca de 30 cm de diâmetro. Complete uma série em uma direção e, em seguida, mude, girando para trás.",
    "E_Alternating_Hooks": "Fique em uma postura cambaleante com a perna esquerda ligeiramente para a frente e os dois punhos protegendo o rosto. Traga a mão direita de volta para o lado e dê um soco em um movimento de gancho enquanto gira o pé direito",
    "E_Up_And_Down_Plank": "Comece na posição de prancha, com os pulsos sob os ombros e os pés afastados na largura do quadril. Dobre o braço esquerdo, coloque o cotovelo esquerdo no tapete e, em seguida, dobre o braço direito e coloque o cotovelo direito no colchonete.Coloque a mão esquerda no colchonete, estique o braço esquerdo e, em seguida, coloque a mão direita no colchonete e endireite o braço direito.Troque os lados e repita esse movimento para cima e para baixo até que a série esteja completa.",
    "E_Triceps_Stretch_Left": "Traga o braço direito pelo corpo. Dobre levemente o cotovelo. Use a mão esquerda para guiar o movimento enquanto pressiona o braço no peito e para a direita. Mantenha esse alongamento por 30 segundos e faça de três a quatro repetições",
    "E_Triceps_Stretch_Right": "Comece em pé ereto, estendendo os braços atrás de você e juntando as mãos atrás das costas. Levante lentamente os braços, vire as mãos para que as palmas das mãos fiquem voltadas para fora e sinta um alongamento no bíceps. por 15 a 30 segundos e depois retorne à posição inicial. Repita por quantas repetições e duração desejar.",

    "E_Chest_Press_Pulse": "Segure os antebraços juntos na altura dos ombros e dobre os cotovelos com as mãos para formar um ""L"". Em seguida, levante os antebraços para cima e para baixo.",
    "E_Modified_Burpees": "Comece de uma posição de prancha alta. Em vez de pular em um agachamento baixo, você vai querer andar um pé para fora de sua mão e depois andar o segundo pé para fora dessa mão. Encontre a parte inferior da mão seu agachamento, levante-se com o peito alto, sem salto no topo. Coloque firmemente suas mãos de volta ao chão em um agachamento baixo e dê um passo para trás, encontrando sua prancha alta novamente ",
    "E_Wall_Sit": "Incline-se contra uma parede e deslize para baixo em um agachamento com os joelhos em um ângulo de 90 graus. E as coxas paralelas ao chão. Mantenha as costas retas contra a parede",
    "E_Left_Quad_Stretch_With_Wall": "Dobre um tapete ou toalha e coloque-o em frente a uma parede. Ajoelhe-se e coloque o joelho direito na toalha e a canela contra a parede. Aponte os dedos dos pés para que a parte superior do pé direito fique contra a parede. Se isso for muito difícil ou machucar o joelho, afaste a toalha alguns centímetros da parede.Coloque o pé esquerdo no chão a cerca de 12 a 18 polegadas de distância da parede, de modo que fique diretamente abaixo do joelho esquerdo. Pressione o pé esquerdo e incline o tronco contra a parede para intensificar o alongamento. Fique aqui por pelo menos 30 segundos. Depois solte lentamente e faça esse alongamento com o pé esquerdo contra a parede.",
    "E_Right_Quad_Stretch_With_Wall": "Dobre um tapete ou toalha e coloque-o na frente de uma parede. Ajoelhe-se e coloque o joelho direito na toalha e a canela contra a parede. Aponte os dedos dos pés para que a parte superior do pé esquerdo fique contra a Se for muito difícil ou machucar o joelho, afaste a toalha alguns centímetros da parede.Coloque o pé direito no chão a cerca de 30 a 40 centímetros da parede, de modo que fique diretamente abaixo do joelho direito. Pressione o pé direito e incline o tronco contra a parede para intensificar o alongamento. Fique aqui por pelo menos 30 segundos. Depois solte lentamente e faça esse alongamento com o pé direito contra a parede.",
    "E_Kneeling_Lunge_Stretch_Right": "Esta é a posição inicial do alongamento do flexor do quadril ajoelhado. Mantendo o tronco ereto, incline-se lentamente para frente até sentir um alongamento confortável através da virilha e parte superior da coxa (perna traseira). Mova-se lentamente para frente e para trás 5 -10 vezes, ou mantenha uma espera por 30 segundos",
    "E_Kneeling_Lunge_Stretch_Left": "Esta é a posição inicial do alongamento do flexor do quadril ajoelhado. Mantendo o tronco ereto, incline-se lentamente para frente até sentir um alongamento confortável na virilha e na parte superior da coxa (perna traseira). Mova-se lentamente para frente e para trás 5 -10 vezes, ou mantenha uma espera por 30 segundos",
    "E_Split_Squat_Right": "Fique em posição dividida com o calcanhar da frente 2 a 4 pés na frente do pé de trás. Levante o calcanhar de trás para colocar o peso uniformemente ao longo dos dedos. O peso do pé da frente deve ser distribuído uniformemente ao longo de todo o pé. Agarre o chão com o pé da frente para criar uma posição estável do pé",
    "E_Split_Squat_Left": "Fique em posição dividida com o calcanhar da frente 2 a 4 pés à frente do pé de trás. Levante o calcanhar de trás para colocar o peso uniformemente ao longo dos dedos dos pés. O peso do pé da frente deve ser distribuído uniformemente ao longo de todo o pé. Agarre o chão com o pé da frente para criar uma posição estável do pé",

    "E_Standing_Biceps_Stretch_Left": "Comece em pé ereto, estendendo os braços atrás de você e agarrando as mãos atrás das costas. Levante lentamente os braços, vire as mãos para que as palmas das mãos fiquem voltadas para fora e sinta um alongamento no bíceps. por 15 a 30 segundos e depois retorne à posição inicial. Repita por quantas repetições e duração desejar.",
    "E_Standing_Biceps_Stretch_Right": "Comece em pé ereto, estendendo os braços atrás de você e juntando as mãos atrás das costas. Levante lentamente os braços, vire as mãos para que as palmas das mãos fiquem voltadas para fora e sinta um alongamento no bíceps. por 15 a 30 segundos e depois retorne à posição inicial. Repita por quantas repetições e duração desejar.",
    "E_Sumo_Squat": "Fique com os pés um pouco mais afastados do que a largura do quadril, os dedos dos pés apontando para fora a cerca de 45 graus. Seus quadris também devem ser girados para fora. Esta é a posição inicial. Inspire enquanto empurra os quadris para trás e abaixa uma posição de agachamento. Mantenha seu núcleo firme, costas retas e joelhos para frente durante este movimento. Expire enquanto retorna à posição inicial. Concentre-se em manter seu peso distribuído uniformemente por todo o calcanhar e mediopé",
    "E_Backward_Lunge": "Fique de pé, com as mãos nos quadris. 2. Dê um grande passo para trás com o pé esquerdo. 3. Abaixe os quadris para que a coxa direita (perna da frente) fique paralela ao chão com o joelho direito posicionado diretamente sobre o tornozelo",
    "E_Standing_Glute_Kickbacks_Right": "Comece ficando em pé, estendendo os braços atrás de você e juntando as mãos atrás das costas. Levante lentamente os braços, vire as mãos para que as palmas das mãos fiquem voltadas para fora e sinta um alongamento no bíceps. por 15 a 30 segundos e depois retorne à posição inicial. Repita por quantas repetições e duração desejar.",
    "E_Standing_Glute_Kickbacks_Left": "Comece em pé ereto, estendendo os braços atrás de você e agarrando as mãos atrás das costas. Levante lentamente os braços, vire as mãos para que as palmas das mãos fiquem voltadas para fora e sinta um alongamento no bíceps. por 15 a 30 segundos e depois retorne à posição inicial. Repita por quantas repetições e duração desejar.",
    "E_Butt_Bridge": "Deite-se de costas com os joelhos dobrados e os pés apoiados no chão. Coloque os braços ao lado do corpo. Em seguida, levante e abaixe o bumbum.",
    "E_Wall_push_ups": "Fique na frente de uma parede a um passo de distância dela. Em seguida, coloque suas mãos em direção à parede e incline-se contra ela. Levante os calcanhares. Lentamente dobre os cotovelos e pressione a parte superior do corpo em direção à parede. Empurre para trás e repita o exercício. Lembre-se de manter o corpo reto.",
    "E_Arm_Circless": "Fique no chão com os braços estendidos para os lados na altura dos ombros. Mova os braços para a frente em círculos e depois mova para trás.",
    "E_Jumping_Squats": "Comece em pé com os pés afastados na distância do quadril e abaixe-se em uma posição de agachamento dobrando os joelhos. Mantenha a coluna reta, o peito levantado e os joelhos atrás dos dedos dos pés. Os braços estão na frente do peito para se equilibrar. balance os braços acima da cabeça. Retorne ao agachamento.",

  };
