    //WORKOUT
    "E_High_Step": "Chạy tại chỗ trong khi kéo đầu gối của bạn càng cao càng tốt trong mỗi bước. Giữ phần trên của bạn thẳng đứng trong bài tập này.",
    "E_SIDE_HOP": "Đứng trên sàn, đặt hai tay trước mặt và nhảy từ bên này sang bên kia",
    "E_SQUATS": "Đứng với hai chân rộng bằng vai và hai tay duỗi thẳng về phía trước, sau đó hạ thấp cơ thể cho đến khi đùi song song với sàn."
        "Đầu gối của bạn phải được mở rộng cùng hướng với ngón chân của bạn. Quay trở lại vị trí ban đầu và thực hiện lần tiếp theo.",
    "E_WALL_PUSH_UP": "Đứng trước bức tường cách nó một bước lớn. Sau đó, đưa hai tay thẳng về phía bức tường và dựa vào nó. Nhấc gót chân lên."
        "Từ từ uốn cong khuỷu tay của bạn và ấn phần trên của bạn về phía tường. Đẩy ra sau và lặp lại bài tập. Nhớ giữ cơ thể thẳng.",
    "E_FIRE_HYDRANT_LEFT": "Bắt đầu bằng bốn chân, đầu gối dưới mông và hai tay đặt dưới vai. Sau đó nhấc chân trái sang một bên ở góc 90 độ.",
    "E_FIRE_HYDRANT_RIGHT": "Bắt đầu bằng bốn chân, đầu gối dưới mông và hai tay đặt dưới vai. Sau đó nhấc chân phải sang một bên ở góc 90 độ.",
    "E_PLANK": "Nằm trên sàn với các ngón chân và cẳng tay đặt trên mặt đất. Giữ cho cơ thể của bạn thẳng và giữ tư thế này càng lâu càng tốt. Bài tập này giúp tăng cường sức mạnh cho bụng, lưng và vai.",
    "E_COBRA_STRETCH": "Đứng trên sàn, sau đó chạy tại chỗ trong khi đá con hạc lên để chạm vào mông theo từng bước. Cố gắng thực hiện càng nhanh càng tốt. Đây là một bài tập tuyệt vời cho cơ mông và gân kheo.",
    "E_CHILD_POSE": "Đứng với hai chân rộng bằng vai và hai tay duỗi thẳng về phía trước, sau đó hạ thấp cơ thể cho đến khi đùi song song với sàn. Đầu gối của bạn phải mở rộng cùng hướng với ngón chân. Trở lại vị trí ban đầu và làm đại diện tiếp theo. ",
    "E_BUTT_BRIDGE": "Nằm ngửa, co đầu gối và đặt bàn chân trên sàn. Đặt hai cánh tay bằng phẳng ở hai bên. Sau đó nâng mông lên và hạ xuống.",
    "E_KNEE_TO_CHEST_STRETCH_LEFT": "Đứng trước bức tường cách tường một bước lớn. Sau đó, đưa hai tay thẳng về phía tường và dựa vào tường. Nhấc gót chân lên. Từ từ uốn cong khuỷu tay và ép phần thân trên của bạn về phía tường. Đẩy quay lại và lặp lại bài tập. Nhớ giữ cơ thể thẳng. ",
    "E_KNEE_TO_CHEST_STRETCH_RIGHT": "Nằm ngửa, gập đầu gối và đặt bàn chân trên sàn. Đặt hai cánh tay bằng phẳng ở hai bên. Sau đó nâng mông lên và hạ xuống.",
    "E_Jumping_Jacks": "Nằm sấp xuống và gập khuỷu tay với hai tay đặt dưới vai, sau đó đẩy ngực lên khỏi mặt đất hết mức có thể. Giữ tư thế này trong vài giây.",
    "E_Heel_Touch": "Bắt đầu với hai bàn chân và cánh tay của bạn ở hai bên, chúng nhảy lên bằng chân của bạn và bàn tay của bạn trên cao. Quay trở lại vị trí bắt đầu sau đó thực hiện lại đại diện tiếp theo. Bài tập này giúp bạn tập luyện toàn thân và hiệu quả tất cả các nhóm cơ lớn của bạn. ",

    "E_Bird_Dog": "Bắt đầu với đầu gối dưới mông và hai tay đặt dưới vai, sau đó duỗi thẳng chân phải và cánh tay trái cùng lúc. Giữ nguyên 5 giây, sau đó quay lại và lặp lại với bên kia.",


    "E_Reverse_Crunches": "Nằm ngửa, đầu gối lên một góc 90 độ và đặt tay sau đầu. Nâng cơ và đùi sau đó duỗi ra. Lặp lại bài tập này.",
    "E_Leg_Raises": "Nằm ngửa, đặt tay xuống dưới hông để làm điểm tựa, sau đó nhấc chân lên cho đến khi tạo thành góc vuông với sàn. Từ từ hạ chân xuống và lặp lại bài tập.",
    "E_Butt_Kicks": "Đứng thẳng trên sàn, sau đó chạy tại chỗ trong khi đá heep lên để chạm vào mông theo từng bước. Cố gắng thực hiện càng nhanh càng tốt. Đây là một bài tập tuyệt vời cho cơ mông và gân kheo.",
    "E_Lying_Twist_Stretch_Left": "Nằm ngửa, hai chân duỗi thẳng và hai tay duỗi thẳng ở hai bên. Khuỵu gối và xoay chân sang trái. Giữ tư thế này.",
    "E_Lying_Twist_Stretch_Right": "Nằm ngửa, hai chân duỗi thẳng và hai tay duỗi thẳng ở hai bên. Khuỵu gối và xoay chân sang bên phải. Giữ tư thế này.",
    "E_Mountain_Climber": "Bắt đầu ở tư thế chống đẩy. Co đầu gối phải về phía ngực và giữ chân trái thẳng, sau đó nhanh chóng chuyển từ chân này sang chân kia. Bài tập này tăng cường sức mạnh cho nhiều nhóm cơ.",
    "E_Donkey_Kicks_Left": "Bắt đầu bằng bốn chân với đầu gối dưới mông và hai tay đặt dưới vai. Sau đó nhấc chân trái và bóp mông hết mức có thể. Quay lại vị trí ban đầu và lặp lại bài tập.",
    "E_Donkey_Kicks_Right": "Bắt đầu bằng bốn chân với đầu gối dưới mông và hai tay đặt dưới vai. Sau đó nhấc chân phải và bóp mông hết mức có thể. Quay lại vị trí ban đầu và lặp lại bài tập.",
    "E_Burpees": "Đứng với hai chân rộng bằng vai, sau đó chống tay xuống đất và đá chân về phía sau. Thực hiện động tác chống đẩy nhanh chóng và nhảy lên.",
    "E_Flutter_Kicks": "Nằm ngửa, đặt cánh tay ở hai bên. Nâng chân và giữ thẳng hết mức có thể. Sau đó nhanh chóng nâng chân phải lên, đồng thời hạ chân trái xuống. Đổi chân và lặp lại.",
    "E_Inchworms": "Bắt đầu với hai bàn chân rộng bằng vai. Thả người và đi hai tay về phía trước càng nhanh càng tốt, sau đó đưa tay ra sau. Lặp lại bài tập.",
    "E_Skipping_Without_Rope": "Đặt hai cánh tay của bạn ở hai bên và giả vờ cầm một tay cầm dây nhảy trong mỗi tay. Nhảy và luân phiên tiếp đất trên quả bóng của bàn chân, đồng thời xoay cổ tay của bạn như thể bạn đang quay một sợi dây.",

    "E_Lying_Butterfly_Stretch": "Nằm trên sàn với bộ gen của bạn gần nhau. Mở đầu gối sang hai bên. Giữ tư thế này",
    "E_Lunges": "Bước về phía trước, hạ thấp cơ thể về phía mặt đất và trở lại vị trí ban đầu",
    "E_Claps_Over_Head": "Để bắt đầu bài tập, nâng cao cánh tay qua đầu trong khi xoay bàn tay sao cho hai lòng bàn tay hướng vào nhau khi cánh tay ở trên đầu để bạn có thể vỗ vào nhau. Hạ cánh tay xuống, úp lòng bàn tay xuống. một lần nữa, và dừng lại ở độ cao ngang vai trước khi lặp lại bài tập để nâng chúng lên cao một lần nữa. Lặp lại động tác này trong suốt thời gian của bài tập. ",
    "E_Adductor_Stretch_In_Standing": "Đứng thẳng, ưỡn ngực và căng cơ. Hai chân phải rộng bằng vai. Bước thẳng sang bên trái, để chân phải ở vị trí cũ. Gập đầu gối trái và dừng lại khi đùi trên bên trái song song xuống đất. ... ",
    "E_Standing_Bicycle_Crunches": "Động tác gập bụng bằng xe đạp đứng Đặt bàn chân của bạn rộng bằng vai và đặt tay sau đầu, sau đó uốn cong đầu gối phải và nâng đầu gối lên về phía khuỷu tay trái. Siết cơ và xiên trong khi thực hiện động tác",
    "E_Side_Lying_Leg_Lift_Left": "Nằm xuống nghiêng sang một bên, tựa đầu vào cánh tay phải. Nâng chân trên của bạn lên và trở lại vị trí ban đầu. Đảm bảo rằng chân trái của bạn thẳng lên và xuống trong suốt bài tập. Đây là một bài tập tuyệt vời cho cơ mông. ",
    "E_Side_Lying_Leg_Lift_Right": "Nằm xuống nghiêng sang một bên, tựa đầu vào cánh tay trái. Nâng chân trên của bạn lên và trở lại vị trí ban đầu. Đảm bảo rằng chân phải của bạn thẳng lên và xuống trong suốt bài tập. Đây là một bài tập tuyệt vời cho cơ mông. ",
    "E_Arm_Scissors": "Đứng thẳng với hai bàn chân rộng bằng vai. Khoanh tay trước mặt ngang vai với một cánh tay chồng lên cánh tay kia theo hình dạng của chữ cái" "X" ", sau đó dang rộng chúng ra. và lặp lại bài tập. ",
    "E_Side_Lunges": "Đứng thẳng với hai chân của bạn. Di chuyển chân phải của bạn sang một bên, sau đó hạ thấp cơ thể trong khi vẫn giữ chân trái thẳng. Quay trở lại vị trí bắt đầu và chuyển sang bên kia.",
    "E_Crunch_Kicks": "Nằm ngửa, hai tay đặt ngang hông và hơi nâng vai. Nâng chân khỏi sàn, uốn cong đầu gối và kéo về phía ngực. Đá chân về phía trước và lặp lại động tác này.",
    "E_Ab belly_Crunches": "Nằm ngửa, gập đầu gối và duỗi thẳng tay về phía trước, sau đó nâng phần trên của bạn lên khỏi sàn. Giữ trong vài giây và từ từ trở lại. Động tác này chủ yếu tác động lên cơ trực tràng và cơ xiên.",
    "E_Slow_Mountain_Climber": "Bắt đầu ở tư thế chống đẩy. Co đầu gối trái về phía ngực và giữ chân phải thẳng. Sau đó từ từ quay lại vị trí ban đầu và chuyển sang chân còn lại.",
    "E_Russian_Twist": "Ngồi trên sàn với đầu gối cong, bàn chân nâng lên một chút và lưng nghiêng về phía sau. Sau đó nắm hai tay lại và vặn người từ bên này sang bên kia.",
    "E_Leg_In_Outs": "Ngồi xuống, hai tay đặt phía sau trên mặt đất, hai chân mở rộng và phần trên cơ thể ngả về phía sau. Co đầu gối và đưa về phía ngực, sau đó duỗi thẳng hoàn toàn hai chân mà không chạm đất. Lặp lại bài tập . ",
    "E_Starfish_Crunch": "Nằm ngửa, hai tay duỗi thẳng sang hai bên. Để hai chân dang rộng, hai bàn chân rộng hơn chiều rộng bằng vai. Nâng chân trái lên, hơi nâng vai lên khỏi sàn và vươn tay phải. để chạm vào chân trái. Quay lại vị trí bắt đầu và lặp lại với bên kia. ",
    "E_Reclinded_Oblique_Twist": "Nằm ngửa, hai chân mở rộng và khuỷu tay đặt ngay dưới vai. Nâng chân trái lên một góc 45 độ trong khi vươn cánh tay phải qua bên trái. Sau đó từ từ quay trở lại vị trí ban đầu . Lặp lại vài lần, sau đó chuyển sang phía bên kia. ",
    "E_Plank_Hip_Dips": "Bắt đầu ở tư thế plank tiêu chuẩn. Xoay cột sống của bạn sang bên trái cho đến khi chân trái chạm sàn, sau đó vặn sang bên kia. Lặp lại bài tập.",
    "E_Bicycle_Crunches": "Đòn đạp xe đạp Nằm trên sàn, đặt tay sau tai. Nâng đầu gối và khép khuỷu tay phải về phía đầu gối trái, sau đó khép khuỷu tay trái về phía đầu gối phải. Lặp lại bài tập.",
    "E_Glute_Kickback_Crossover_With_Left_Leg": "Bắt đầu bằng bốn chân với đầu gối dưới mông và hai tay đặt ngay dưới vai. Đưa chân trái ra sau, sau đó hạ xuống sang bên phải. Nhấc chân lên một lần nữa và hạ thẳng xuống",
    "E_Glute_Kickback_Crossover_With_Right_Leg": "Bắt đầu bằng bốn chân, đầu gối dưới mông và đặt tay trực tiếp dưới vai. Đưa chân phải ra sau, sau đó hạ xuống bên trái. Nhấc chân phải lên một lần nữa và hạ thẳng xuống.",
    "E_Prone_Flutter_Kicks": "Nằm sấp, hai chân mở rộng và chống cằm trên cánh tay. Khuỵu chân khỏi sàn, sau đó luân phiên nhấc chân trái và chân phải.",
    "E_Bent_Knee_Side_Hip_Raises_Left": "Nằm nghiêng sang bên phải, chống khuỷu tay xuống sàn và đầu gối cong. Đặt tay trái lên hông. Nâng hông lên cao hết mức có thể, sau đó thả xuống mà không chạm sàn. Lặp lại động tác tập thể dục.",
    "E_Bent_Knee_Side_Hip_Raises_Right": "Nằm nghiêng sang bên trái, chống khuỷu tay xuống sàn và đầu gối cong. Đặt tay phải lên hông. Nâng hông lên cao hết mức có thể, sau đó thả xuống mà không chạm sàn Lặp lại bài tập . ",
    "E_Butterfly_Bridge": "Nằm ngửa, hai tay đặt sang hai bên và đầu gối gập lại và mở sang hai bên. Bóp và nâng hông lên khỏi mặt đất, đồng thời đưa hai đầu gối lại với nhau, sau đó trở lại vị trí ban đầu. Lặp lại bài tập . ",
    "E_Pilates_Clamshell_Left": "Nằm nghiêng sang bên phải, tựa đầu vào cánh tay phải và đầu gối co lại. Nâng đầu gối trái lên trên đồng thời giữ cho gót chân chạm nhau, sau đó quay trở lại vị trí ban đầu. Lặp lại bài tập.",
    "E_Pilates_Clamshell_Right": "Nằm nghiêng sang bên trái, tựa đầu vào cánh tay trái và đầu gối cong. Nâng đầu gối phải lên trên đồng thời giữ cho gót chân chạm nhau, sau đó quay lại vị trí ban đầu. Lặp lại bài tập.",
    "E_Donkey_Kicks_Left_Pulse": "Bắt đầu bằng bốn chân, đầu gối dưới mông và hai tay đặt dưới vai. Sau đó nhấc chân trái lên với đầu gối một góc 90 độ cho đến khi đùi song song với sàn. Bóp mông và nâng cao đầu gối trái của bạn lên xuống nhịp nhàng. ",
    "E_Donkey_Kicks_Right_Pulse": "Bắt đầu bằng bốn chân với đầu gối dưới mông và hai tay đặt dưới vai. Sau đó nâng chân phải với đầu gối ở một góc 90 độ cho đến khi đùi song song với sàn. Bóp mông và nâng cao đầu gối phải của bạn lên xuống nhịp nhàng. ",
    "E_Froggy_Glute_Lifts": "Nằm sấp, gập đầu gối và hai gót chân ép vào nhau, sau đó nhấc chân lên và hạ xuống. Bài tập này rất hiệu quả trong việc bóp mông.",
    "E_Glute_Kickback_Pulse_Left": "Bắt đầu bằng bốn chân, đầu gối dưới mông và hai tay đặt dưới vai. Đưa chân trái về phía sau với ngón chân hướng xuống. Nâng chân đã nhấc lên xuống nhịp nhàng.",
    "E_Glute_Kickback_Pulse_Right": "Bắt đầu bằng bốn chân, đầu gối dưới mông và hai tay đặt dưới vai. Đưa chân phải về phía sau với ngón chân hướng xuống. Nâng chân đã nhấc lên xuống nhịp nhàng.",
    "E_Plie_Squats": "Đứng với hai tay chống hông và hai bàn chân rộng hơn chiều rộng vai một chút, sau đó hạ thấp cơ thể cho đến khi đùi song song với sàn. Đầu gối phải mở rộng cùng hướng với nhón gót.",
    "E_Frog_Press": "Nằm ngửa, nâng chân lên, đầu gối cong và gót chân ép vào nhau. Đặt hai tay bằng hai bên hông. Duỗi thẳng chân và đưa về vị trí ban đầu. Lặp lại bài tập.",

    "E_Side_Leg_Circles_Left": "Nằm nghiêng sang bên phải, tựa đầu vào tay phải. Sau đó nhấc chân trái và xoay bàn chân theo vòng tròn.",
    "E_Side_Leg_Circles_Right": "Nằm nghiêng sang bên trái, tựa đầu vào tay trái, sau đó nhấc chân phải và xoay bàn chân theo vòng tròn.",
    "E_Glute_Kick_Back_Left": "Bắt đầu bằng bốn chân với đầu gối dưới mông và hai tay đặt trực tiếp dưới vai. Sau đó đá một chân về phía sau cho đến khi nó song song với mặt đất. Chuyển sang bên kia sau vài hiệp.",
    "E_Glute_Kick_Back_Right": "Bắt đầu bằng bốn chân, đầu gối dưới mông và hai tay đặt trực tiếp dưới vai. Sau đó đá một chân về phía sau cho đến khi nó song song với mặt đất. Chuyển sang bên kia sau vài hiệp.",
    "E_Bottom_Leg_Lift_Left": "Nằm nghiêng sang bên trái, tựa đầu vào tay trái, sau đó đặt chân phải về phía trước trên sàn. Nâng chân trái của bạn lên và xuống.",
    "E_Bottom_Leg_Lift_Right": "Nằm nghiêng sang bên phải, tựa đầu vào tay phải. Sau đó đặt chân trái về phía trước trên sàn. Nâng chân phải của bạn lên và xuống.",
    "E_Straight_Leg_Fire_Hydrant_Left": "Bắt đầu với hai tay đặt dưới vai, đầu gối phải ngay dưới mông và chân trái duỗi thẳng và đặt trên mặt đất. Đưa chân trái sang bên trái. Trở lại vị trí ban đầu và lặp lại bài tập. ",
    "E_Straight_Leg_Fire_Hydrant_Right": "Bắt đầu với hai tay đặt dưới vai, đầu gối trái đặt ngay dưới mông và chân phải duỗi thẳng và đặt trên mặt đất. Đưa chân phải sang bên phải. Trở lại vị trí ban đầu và lặp lại bài tập. ",
    "E_Scissors": "Nâng chân của bạn và bắt chéo đùi phải qua trái, sau đó đảo ngược bài tập. Đảm bảo lưng của bạn luôn bằng phẳng. Đây là một bài tập tuyệt vời cho cơ xiên và cơ bụng trực tràng.",
    "E_Curtsy_Lunges": "Đứng thẳng. Sau đó, lùi lại bằng chân trái sang phải và đồng thời uốn cong đầu gối. Quay lại vị trí bắt đầu và chuyển sang bên kia.",
    "E_Heel_To_The_Heavens": "Bài tập này nhắm vào cơ bụng dưới của bạn, nằm ngửa, hai tay chống hai bên và hai chân thẳng hướng lên trần nhà. Nâng hông thẳng lên khỏi sàn. Quay lại và lặp lại",
    "E_Cross_Knee_Plank": "Bắt đầu ở tư thế plank với vai trên cổ tay, bàn chân khép vào nhau và cơ thể trên một đường thẳng. Trượt đầu gối phải dưới bụng để chạm vào khuỷu tay trái, sau đó thả ra trở lại vị trí bắt đầu. kéo đầu gối trái của bạn xuống dưới bụng để chạm vào khuỷu tay phải, sau đó thả ra trở lại vị trí bắt đầu. Tiếp tục với số đại diện mong muốn. Giữ chặt cơ bụng và kiểm soát cơ thể. ",
    "E_Cross_Arm_Crunches": "Nằm ngửa, gập đầu gối, vắt chân phải lên trên đầu gối trái và dùng tay trái đỡ đầu. Co và đưa khuỷu tay trái ngang người và hướng về đầu gối phải. Lặp lại nhiều lần nhất có thể và đổi bên. ",
    "E_X_Man_Crunch": "Bắt đầu đứng với cả hai chân trên sàn rộng bằng vai. Đặt cả hai tay sau đầu. Trong khi giữ chân phải mở rộng, hãy uốn cong đầu gối trái và kéo nó về phía ngực. Không vặn thân và mở rộng. đầu gối phải để trở lại vị trí ban đầu. ",
    "E_V_Hold": "Nằm ngửa, đưa tay qua đầu. Nâng cánh tay, vai và chân lên khỏi mặt đất và giữ tư thế nâng này bằng cách co bụng lại. Đưa tay thẳng về phía ống chân trong khi vẫn duy trì cột sống khỏe.",
    "E_Side_Crunches_Left": "Đứng cầm một quả tạ, tạ ấm hoặc thậm chí một cuốn sách nặng ở bên cạnh bạn bằng một tay, lòng bàn tay hướng vào trong. Đưa thân về phía bạn đang cầm tạ. Chuyển tạ sang bên, đứng thẳng . ",
    "E_Side_Crunches_Right": "Đứng cầm một quả tạ, quả tạ ấm hoặc thậm chí một cuốn sách nặng ở bên cạnh bạn bằng một tay, lòng bàn tay hướng vào trong. Đưa thân về phía bạn đang cầm tạ. Chuyển tạ sang bên, đứng thẳng . ",
    "E_Punches": "Đứng với một chân của bạn về phía trước và đầu gối của bạn hơi cong. Gập khuỷu tay và siết chặt cánh tay đầu tiên của bạn trước mặt. Mở rộng một cánh tay về phía trước với lòng bàn tay hướng xuống sàn. Đưa cánh tay ra sau và lặp lại với động tác cánh tay khác. ",
    "E_Seated_Overhead_Tricep_Extension": "Ngồi thẳng lưng trên băng ghế. Nhẹ nhàng tạo thành nắm đấm và đặt chúng lại với nhau. Đưa hai tay lên cao, sau đó hạ xuống sau đầu. Nâng cao lên một lần nữa và lặp lại bài tập.",
    "E_Dynamic_Chest": "Đứng trên sàn, hai chân rộng bằng vai. Mở rộng cánh tay của bạn về phía trước cao ngang vai với lòng bàn tay hướng vào nhau. Mở rộng cánh tay của bạn ra xa nhất có thể, sau đó đưa chúng ra phía trước. Lặp lại bài tập . ",
    "E_Heep_Touch": "Nằm ngửa trên mặt đất, đầu gối uốn cong và hướng lên trần nhà. Với cánh tay bên hông, nâng vai của bạn lên một chút khỏi mặt đất. Sử dụng cơ bụng của bạn xoay bàn tay phải của bạn xuống bàn chân phải và sau đó sao lưu. Sau đó làm điều tương tự với tay trái của bạn. ",

    "E_Side_Arm_Raise": "Đứng với hai chân rộng bằng vai. Nâng cánh tay của bạn sang hai bên ngang vai, sau đó đặt chúng xuống. Lặp lại bài tập. Giữ thẳng tay trong khi thực hiện.",
    "E_Triceps_Kickbacks": "Ngả người về phía trước, uốn cong đầu gối và khuỷu tay của bạn. Mở rộng cánh tay của bạn về phía sau và siết chặt cơ ba đầu của bạn. Vui lòng để cánh tay của bạn song song với mặt đất khi mở rộng chúng. Quay trở lại vị trí bắt đầu và lặp lại bài tập này.",
    "E_Shoulder_Gators": "Đứng thẳng, hai tay đặt cạnh tai và khuỷu tay hướng về mỗi bên. Xoay khuỷu tay của bạn cho đến khi cả hai đều hướng về phía trước.",
    "Knee_Push_ups": "Quỳ trên sàn. Mở rộng cánh tay và đặt hai tay rộng bằng vai trên sàn trước mặt. Căng cơ bụng trong khi bạn uốn cong cánh tay, hạ thấp thân cho đến khi ngực chạm sàn. Đẩy thân lên trở lại bằng cách duỗi thẳng cánh tay. . Chậm và ổn định, em yêu. Rửa sạch và lặp lại. ",
    "E_Triceps_Dips": "Ngồi trên mép ghế ổn định, ghế tập tạ hoặc bước và bám vào mép cạnh hông của bạn. Các ngón tay của bạn phải hướng vào bàn chân, mở rộng hai chân và cách nhau rộng bằng hông, gót chân chạm đất. Nhìn thẳng về phía trước, nâng cằm lên. Ấn vào lòng bàn tay để nâng cơ thể và trượt về phía trước vừa đủ để phía sau chạm mép ghế. độ. Kiểm soát chuyển động trong suốt phạm vi chuyển động. Từ từ lùi người lên cho đến khi cánh tay của bạn gần như thẳng và lặp lại. ",
    "E_Arm_Circles_Clockwise": "Đứng thẳng với hai bàn chân rộng bằng vai. Nâng và mở rộng cánh tay của bạn sang hai bên mà không uốn cong khuỷu tay. Từ từ xoay cánh tay của bạn về phía trước, tạo thành những vòng tròn nhỏ có đường kính khoảng 1 foot. Hoàn thành hiệp tập theo một hướng. và sau đó chuyển đổi, xoay ngược lại. ",
    "E_Arm_Circles_Counterclockwise": "Đứng thẳng với hai bàn chân rộng bằng vai. Nâng và mở rộng cánh tay của bạn sang hai bên mà không uốn cong khuỷu tay. Từ từ xoay cánh tay của bạn về phía trước, tạo thành những vòng tròn nhỏ có đường kính khoảng 1 foot. Hoàn thành hiệp tập theo một hướng. và sau đó chuyển đổi, xoay ngược lại. ",
    "E_Alternating_Hooks": "Đứng trong tư thế so le, chân trái của bạn hơi hướng về phía trước và cả hai nắm đấm bảo vệ khuôn mặt của bạn. Đưa tay phải của bạn trở lại bên hông và đấm xung quanh theo chuyển động ngửa trong khi xoay bàn chân phải của bạn",
    "E_Up_And_Down_Plank": "Bắt đầu ở tư thế plank, cổ tay đặt dưới vai và bàn chân rộng bằng hông. Bẻ cánh tay trái, đặt khuỷu tay trái trên thảm, sau đó uốn cong cánh tay phải và đặt khuỷu tay phải lên Đặt tay trái của bạn lên thảm, duỗi thẳng cánh tay trái rồi đặt tay phải lên thảm và duỗi thẳng cánh tay phải. Đổi bên và lặp lại động tác lên xuống này cho đến khi tập xong. ",
    "E_Triceps_Stretch_Left": "Đưa cánh tay phải của bạn ngang cơ thể. Hơi khủy tay ra. Sử dụng tay trái để hướng dẫn chuyển động khi bạn ấn cánh tay vào ngực và qua bên phải. Giữ động tác này 30 giây và thực hiện 3-4 lần. lặp lại ",
    "E_Triceps_Stretch_Right": "Bắt đầu bằng cách đứng thẳng, mở rộng hai tay ra phía sau và nắm hai tay lại sau lưng. trong 15 đến 30 giây rồi trở lại vị trí ban đầu. Lặp lại nhiều lần và thời lượng như mong muốn. ",

    "E_Chest_Press_Pulse": "Giữ hai cẳng tay của bạn ngang với độ cao bằng vai và uốn cong khuỷu tay của bạn với hai bàn tay của bạn để tạo thành hình chữ" "L" ". Sau đó nâng cẳng tay của bạn lên và xuống.",
    "E_Modified_Burpees": "Bắt đầu từ tư thế plank cao. Thay vì nhảy vào một tư thế ngồi xổm thấp, bạn sẽ muốn bước một chân ra phía ngoài bàn tay và sau đó đi bàn chân thứ hai vào bên ngoài bàn tay đó. Tìm phần dưới cùng của squat của bạn, đứng thẳng với ngực của bạn cao, KHÔNG nhảy ở trên cùng. Đặt hai tay của bạn xuống đất trong tư thế squat thấp và bước từng chân về phía sau để tìm lại tấm ván cao của bạn ",
    "E_Wall_Sit": "Dựa vào tường và trượt xuống tư thế ngồi xổm với đầu gối tạo một góc 90 độ. Đồng thời đùi song song với sàn. Giữ lưng thẳng dựa vào tường",
    "E_Left_Quad_Stretch_With_Wall": "Gấp tấm thảm hoặc khăn tắm lên và đặt trước tường. Quỳ xuống và đặt đầu gối phải của bạn lên khăn và ống chân của bạn dựa vào tường. Chỉ ngón chân của bạn sao cho đầu bàn chân phải của bạn áp vào Nếu việc này quá cứng hoặc làm bạn đau đầu gối, hãy di chuyển khăn ra xa tường vài inch. Đặt bàn chân trái trên mặt đất cách tường khoảng 12 đến 18 inch, sao cho nó nằm ngay bên dưới đầu gối trái của bạn. Nhấn vào bàn chân trái của bạn và dựa lưng vào tường để tăng cường độ căng.",
    "E_Right_Quad_Stretch_With_Wall": "Gấp một tấm thảm hoặc khăn tắm lên và đặt trước một bức tường. Quỳ xuống và đặt đầu gối phải của bạn lên khăn và ống chân của bạn dựa vào tường. Chỉ ngón chân của bạn sao cho đầu bàn chân trái của bạn áp vào Nếu việc này quá cứng hoặc làm bạn đau đầu gối, hãy di chuyển khăn ra xa tường vài inch. Đặt chân phải của bạn trên mặt đất cách tường khoảng 12 đến 18 inch, sao cho nó nằm ngay bên dưới đầu gối phải của bạn. Nhấn vào bàn chân phải của bạn và dựa lưng vào tường để tăng cường độ giãn.",
    "E_Kneeling_Lunge_Stretch_Right": "Đây là vị trí bắt đầu của động tác duỗi cơ gấp hông khi khuỵu xuống. Giữ thân thẳng đứng, từ từ ngả người về phía trước cho đến khi bạn cảm thấy thoải mái khi duỗi qua háng và đỉnh đùi (chân sau). Di chuyển từ từ qua lại 5 -10 lần hoặc duy trì giữ trong 30 giây ",
    "E_Kneeling_Lunge_Stretch_Left": "Đây là vị trí bắt đầu của động tác duỗi cơ gập hông khi khuỵu xuống. Giữ thân thẳng đứng, từ từ ngả người về phía trước cho đến khi bạn cảm thấy thoải mái khi duỗi qua háng và đỉnh đùi (chân sau). Di chuyển từ từ qua lại 5 -10 lần hoặc duy trì giữ trong 30 giây ",
