    "E_Glute_Kickback_Crossover_With_Right_Leg": "四肢着地,膝盖在臀部下方,双手直接在肩膀下方。向后抬起右腿,然后将其降低到左侧。 再次将其抬起并直接向下降低。.",
    "E_Prone_Flutter_Kicks": "俯卧,双腿伸直,下巴放在手臂上。将双腿抬离地板,然后交替抬起左右腿。",

    "E_Bent_Knee_Side_Hip_Raises_Left": "躺在你的右侧,肘部放在地板上,膝盖弯曲。 把你的左手放在你的臀部上。尽可能高地抬起你的臀部,然后在不接触地板的情况下放下它们。重复这个练习。",
    "E_Bent_Knee_Side_Hip_Raises_Right": "躺在你的左侧,肘部放在地板上,膝盖弯曲。 将右手放在臀部上。尽可能高地抬起臀部,然后在不接触地板的情况下放下臀部重复练习。",
    "E_Butterfly_Bridge": "仰卧,双臂放在身体两侧,膝盖弯曲并向两侧张开。挤压并将臀部抬离地面,然后将膝盖并拢,然后回到起始位置。 重复练习。",
    "E_Pilates_Clamshell_Left": "右侧卧,头靠在右臂上,膝盖弯曲。抬起左膝,同时保持脚跟接触,然后回到起始位置。 重复练习。",
    "E_Pilates_Clamshell_Right": "左侧躺,头靠在左臂上,膝盖弯曲。抬起右膝,同时保持脚跟接触,然后回到起始位置。 重复练习。",
    "E_Donkey_Kicks_Left_Pulse": "四肢着地开始,膝盖在臀部下方,双手在肩膀下方。然后将左腿抬起,膝盖呈 90 度角,直到大腿与地板平行。 挤压你的臀部,并有节奏地上下抬起你的左膝。",
    "E_Donkey_Kicks_Right_Pulse": "四肢着地开始,膝盖在臀部下方,双手在肩膀下方。然后以 90 度角抬起右腿,膝盖呈 90 度角,直到大腿与地板平行。 挤压你的臀部,并有节奏地上下抬起你的右膝。",
    "E_Froggy_Glute_Lifts": "俯卧,膝盖弯曲,脚跟并拢。然后上下抬起双脚。 这个练习对挤压你的臀部非常有效。",
    "E_Glute_Kickback_Pulse_Left": "四肢着地开始,膝盖放在臀部下方,双手放在肩膀下方。左腿向后抬起,脚趾朝下。有节奏地上下抬起抬起的腿。",
    "E_Glute_Kickback_Pulse_Right": "四肢着地开始,膝盖在臀部下方,双手在肩膀下方。右腿向后抬起,脚趾朝下。有节奏地上下抬起抬起的腿。",
    "E_Plie_Squats": "双手放在臀部站立,双脚分开略宽于肩宽。然后降低身体,直到大腿与地板平行。膝盖应与脚尖向同一方向伸展。",
    "E_Frog_Press": "仰卧,双腿抬起,膝盖弯曲,脚跟并拢。 将手臂平放在身体两侧。伸直双腿并将它们带回起始位置。 重复练习。",

    "E_Side_Leg_Circles_Left": "右侧躺,头靠在右手上。然后抬起左腿并旋转脚。",
    "E_Side_Leg_Circles_Right": "左侧躺,头靠在左手上。然后抬起右腿并旋转脚。",
    "E_Glute_Kick_Back_Left": "四肢着地,膝盖在臀部下方,双手直接在肩膀下方。然后将一条腿向后踢,直到与地面平行。 几组后换另一侧。",
    "E_Glute_Kick_Back_Right": "四肢着地,膝盖在臀部下方,双手直接在肩膀下方。然后将一条腿向后踢,直到与地面平行。 几组后换另一侧。",
    "E_Bottom_Leg_Lift_Left": "左侧躺,头靠在左手上。然后将右脚向前放在地板上。 上下抬起左腿。",
    "E_Bottom_Leg_Lift_Right": "右侧卧,头靠右手。然后将左脚向前放在地板上。 上下抬起右腿。",
    "E_Straight_Leg_Fire_Hydrant_Left": "从你的手在你的肩膀下开始,你的右膝盖直接在你的屁股下面,你的左腿伸展并放在地上。把你的左腿抬到你的左侧。 回到起始位置并重复练习。",
    "E_Straight_Leg_Fire_Hydrant_Right": "从双手放在肩膀下方开始,左膝直接在臀部下方,右腿伸展并放在地面上。将右腿抬到右侧。 回到起始位置并重复练习。",

    "E_Scissors": "抬起双腿,将右大腿越过左侧,然后反向练习。确保背部始终平坦。这是锻炼腹斜肌和腹直肌的好方法。",
    "E_Curtsy_Lunges": "站直。 然后后退一步,左腿向右,同时弯曲膝盖。回到起始位置,换另一侧。",
    "E_Heel_To_The_Heavens": "	这个练习的目标是你的下腹部仰卧,双手放在身体两侧,双腿伸直朝向天花板。 将臀部从地板上直接抬起。 返回并重复.",
    "E_Cross_Knee_Plank": "从木板位置开始,肩膀放在手腕上,双脚并拢,身体成一条直线。将右膝盖拉到腹部下方,接触左肘,然后松开回到起始位置。现在将左膝盖拉到下方 腹部接触右肘,然后松开回到起始位置。 继续进行所需的次数。 保持腹肌收紧,控制身体。",
    "E_Cross_Arm_Crunches": "平躺在你的背上,膝盖弯曲。将右腿交叉在左膝盖上,用左手支撑你的头。紧缩并将左肘穿过身体并朝向右膝盖。重复尽可能多的次数 尽你所能,换边。",
    "E_X_Man_Crunch": "开始站立,双脚分开与肩同宽。 将双手放在头后。在保持右腿伸展的同时,弯曲左膝盖并将其拉向胸部。解开躯干并伸展右膝盖以返回起始位置。",
    "E_V_Hold": "仰卧,双臂举过头顶。 将手臂、肩膀和腿抬离地面,并通过收缩腹部来保持这个抬起的姿势。 将手臂伸向小腿,同时保持强壮的脊椎。",
    "E_Side_Crunches_Left": "一只手拿着哑铃、壶铃,甚至是一本沉重的书站在你身边,手掌朝内。将你的躯干弯曲到你拿着重量的一侧。将重量放回你的身边,站直。",
    "E_Side_Crunches_Right": "一只手拿着哑铃、壶铃,甚至是一本沉重的书站在你身边,手掌朝内。将你的躯干弯曲到你拿着重量的一侧。将重量放回你的身边,站直。",
    "E_Punches": "站立,一条腿向前,膝盖略微弯曲。 弯曲你的肘部并在你的脸前握紧你的第一个。向前伸展一只手臂,手掌朝向地板。 将手臂收回并用另一只手臂重复。",
    "E_Seated_Overhead_Tricep_Extension": "坐在长凳上,背部挺直。 轻轻地将双手握成拳头并放在一起。将双手举过头顶,然后将它们放低到脑后。 再次抬起它们,然后重复练习。",
    "E_Dynamic_Chest": "站在地板上,双脚分开与肩同宽。双臂向前伸展,与肩同高,手掌相对。双臂尽可能向外伸展,然后将它们移回前面。重复练习.",
    "E_Heep_Touch": "躺下,背部着地,膝盖弯曲并指向天花板。双臂放在身体一侧,肩膀略微抬离地面。用你的腹肌将你的右手向下旋转到右脚,然后然后备份。然后用你的左手做同样的事情。",
    "E_Side_Arm_Raise": "双脚分开与肩同宽站立。将双臂举到与肩同高的两侧,然后放下。重复练习。在练习过程中保持双臂伸直。",
    "E_Triceps_Kickbacks":"坐在稳定的椅子、举重凳的边缘,或踩踏并抓住臀部旁边的边缘。你的手指应该指向你的脚,双腿伸展,双脚分开大约与臀部同宽,脚后跟着地。下巴向上直视前方。用手掌抬起身体并向前滑动足够远,使你的背部离开椅子的边缘。降低自己,直到你的肘部弯曲在 45 到 90 之间度数。在整个运动范围内控制运动。慢慢将自己向后推,直到手臂几乎伸直,然后重复。",



    "E_Shoulder_Gators": "站直,双手放在耳朵旁边,肘部朝向两侧。旋转肘部,直到它们都朝向前方。",
    "Knee_Push_ups":"跪在地板上。伸展双臂,双手与肩同宽,放在你面前的地板上。弯曲双臂时收紧腹肌 降低躯干,直到胸部擦过地板。通过伸直双臂将躯干向上推. 缓慢而稳定,宝贝。冲洗并重复。",
    "E_Triceps_Dips":"坐在稳定的椅子、举重凳的边缘,或踩踏并抓住臀部旁边的边缘。你的手指应该指向你的脚,双腿伸展,双脚分开大约与臀部同宽,脚后跟着地。下巴向上直视前方。用手掌抬起身体并向前滑动足够远,使你的背部离开椅子的边缘。降低自己,直到你的肘部弯曲在 45 到 90 之间度数。在整个运动范围内控制运动。慢慢将自己向后推,直到手臂几乎伸直,然后重复。",
    "E_Arm_Circles_Clockwise":"站直,双脚分开与肩同宽。抬起并伸展手臂向两侧,不要弯曲肘部。慢慢向前转动手臂,做直径约 1 英尺的小圆圈。在一个方向完成一组然后切换,向后旋转。",
    "E_Arm_Circles_Counterclockwise": "站直,双脚分开与肩同宽。抬起双臂向两侧伸展,不要弯曲肘部。慢慢向前旋转双臂,做直径约 1 英尺的小圆圈。在一个方向完成一组然后切换,向后旋转。",
    "E_Alternating_Hooks":"以交错的姿势站立,左腿略微向前,双拳保护你的脸。将你的右手放回身体一侧,并在右脚旋转的同时以钩子的方式四处打拳",
    "E_Up_And_Down_Plank":"从木板姿势开始,手腕在肩膀下方,双脚分开与臀部同宽。弯曲左臂,将左肘放在垫子上,然后弯曲右臂,将右肘放在垫子上垫子。把你的左手放在垫子上,伸直你的左臂,然后把你的右手放在垫子上,伸直你的右臂。换边并重复这个上下运动,直到完成。",
    "E_Triceps_Stretch_Left":"把你的右臂放在你的身体上。稍微弯曲你的肘部。当你把你的手臂压向你的胸部并向右移动时,用你的左手引导动作。保持这个伸展 30 秒,做三到四次重复",
    "E_Triceps_Stretch_Right":"首先站直,双臂在身后伸展,双手在背后并拢。慢慢抬起双臂,转动双手,使手掌朝外,感受二头肌的拉伸。握住15 到 30 秒,然后回到起始位置。根据需要重复尽可能多的次数和持续时间。",

  "E_Chest_Press_Pulse": "将前臂并拢到肩高,双手弯曲肘部,形成 L 形。然后上下抬起前臂。",
  "E_Modified_Burpees":"从高位平板支撑开始。与其跳成低蹲,不如将一只脚移到手的外侧,然后将第二只脚移到那只手的外侧。找到底部你的深蹲,挺胸站起来,不要在顶部跳跃。在低蹲中将双手牢牢地放回地面,然后每只脚向后退,再次找到你的高板",
  "E_Wall_Sit":"靠在墙上并向下滑动,膝盖呈 90 度角。大腿与地板平行。保持背部平贴在墙上",
  "E_Left_Quad_Stretch_With_Wall":"将垫子或毛巾折叠起来,放在墙前。跪下,右膝放在毛巾上,小腿靠在墙上。脚趾指向,右脚顶部靠在墙上。如果这太硬,或者它伤害了你的膝盖,把毛巾移到离墙几英寸的地方。把你的左脚放在离墙大约 12 到 18 英寸的地面上,这样它就在你的左膝正下方。压入左脚,将躯干向后靠在墙上以加强拉伸。在这里停留至少 30 秒。然后慢慢松开,左脚靠在墙上做这个拉伸。",
  "E_Right_Quad_Stretch_With_Wall":"将垫子或毛巾折叠起来,放在墙前。跪下,右膝放在毛巾上,小腿靠在墙上。脚趾指向,左脚顶部靠在墙上。如果这太硬,或者它伤害了你的膝盖,把毛巾移到离墙几英寸的地方。把你的右脚放在离墙大约 12 到 18 英寸的地面上,这样它就在你的右膝盖下面。右脚压入,将躯干向后靠在墙上以加强拉伸。在这里停留至少 30 秒。然后慢慢松开,右脚靠在墙上做这个拉伸。",
  "E_Kneeling_Lunge_Stretch_Right":"这是跪髋屈肌伸展的起始位置。保持躯干直立,慢慢向前倾,直到感觉通过腹股沟和大腿顶部（后腿）感到舒适的伸展。来回缓慢移动 5 -10 次,或保持 30 秒",
  "E_Kneeling_Lunge_Stretch_Left":"这是跪髋屈肌伸展的起始位置。保持躯干直立,慢慢向前倾,直到感觉通过腹股沟和大腿顶部（后腿）感到舒适的伸展。来回缓慢移动 5 -10 次,或保持 30 秒",
  "E_Split_Squat_Right":"分叉站立,前脚跟在后脚前 2-4 英尺处。抬起后脚跟,使重量均匀分布在脚趾上。前脚上的重量应均匀分布在整个脚上脚。用你的前脚抓住地板,创造一个稳定的脚位",
  "E_Split_Squat_Left":"分开站立,前脚跟在后脚前 2-4 英尺。抬起后脚跟,使重量均匀分布在脚趾上。前脚上的重量应均匀分布在整个脚趾上脚。用你的前脚抓住地板,创造一个稳定的脚位",
  "E_Standing_Biceps_Stretch_Left":"首先站直,将双臂伸到身后,双手并拢在背后。慢慢抬起双臂,转动双手,使手掌朝外,感受二头肌的拉伸。握住15 到 30 秒,然后回到起始位置。根据需要重复尽可能多的次数和持续时间。",
  "E_Standing_Biceps_Stretch_Right":"首先站直,将双臂伸到身后,双手并拢在背后。慢慢抬起双臂,转动双手,使手掌朝外,感受二头肌的拉伸。握住15 到 30 秒,然后回到起始位置。根据需要重复尽可能多的次数和持续时间。",
  "E_Sumo_Squat":"站立,双脚分开略宽于臀部宽度,脚趾向外指向约 45 度。你的臀部也应该向外旋转。这是起始位置。吸气同时将臀部向后推并降低到蹲姿。在这个动作中保持你的核心收紧,背部挺直,膝盖向前。呼气,同时回到起始位置。专注于保持你的体重均匀分布在你的脚跟和中足",
  "E_Backward_Lunge":"站直,双手放在臀部。2.左脚向后一大步。3.降低臀部,使右大腿（前腿）与右膝平行于地板直接位于脚踝上方",
  "E_Standing_Glute_Kickbacks_Right":"首先站直,将双臂伸到身后,双手并拢在背后。慢慢抬起双臂,转动双手,使手掌朝外,感受二头肌的拉伸。握住15 到 30 秒,然后回到起始位置。根据需要重复尽可能多的次数和持续时间。",
  "E_Standing_Glute_Kickbacks_Left":"首先站直,将双臂伸到身后,双手并拢在背后。慢慢抬起双臂,转动双手,使手掌朝外,感受二头肌的拉伸。握住15 到 30 秒,然后回到起始位置。根据需要重复尽可能多的次数和持续时间。",
  "E_Butt_Bridge": "仰卧,膝盖弯曲,双脚平放在地板上。双臂平放在身体两侧。然后上下抬起臀部。",
  "E_Wall_push_ups": "站在离墙一大步的墙前。然后将手伸直朝向墙靠在墙上。抬起脚后跟。慢慢弯曲肘部,将上半身压向墙。推回来重复练习。记住要保持身体挺直。",
